INSERT INTO `about_us` (`id`, `image`, `description`, `keyword_title`, `keyword_description`, `keyword_author`, `added_by`, `created_at`, `updated_at`) VALUES
(1, 'about-us.jpg', '<p>Techno Apogee started its operation in June 2006 in Dhaka, Bangladesh. We provide the best EPC support in Bangladesh\'s Fire Electrical &amp; Automation field. We confirm the most precise and cost-effective solution for Government and private sectors in Bangladesh. <br> <br> Techno Apogee is continuing its business as a Projects Solution Design, Supplier, and Service provider of a wide range of Fire Safety Solutions, Electrical Solutions, and Automation Solutions.<br> <br> We are the authorized Electronics Safety and Security Association of Bangladesh (ESSAB) member. Moreover, we are also enlisted members of the Fire Service Civil Defense (FSCD) &amp; Department of Inspection for Factories and Establishments (DIFE).</p>', 'Techno Apogee Engineering - Techno Apogee', 'Techno Apogee started its operation in June 2006 in Dhaka, Bangladesh. We provide the best EPC support in Bangladesh\'s Fire Electrical & Automation field. We confirm the most precise and cost-effective solution for Government and private sectors in Bangladesh.  Techno Apogee is continuing its business as a Projects Solution Design, Supplier, and Service provider of a wide range of Fire Safety Solutions, Electrical Solutions, and Automation Solutions.  We are the authorized Electronics Safety and Security Association of Bangladesh (ESSAB) member. Moreover, we are also enlisted members of the Fire Service Civil Defense (FSCD) & Department of Inspection for Factories and Establishments (DIFE).', 'Techno Apogee', 'Sam', '2023-08-08 10:25:16', '2023-09-14 04:19:36');
