INSERT INTO `blogs` (`id`, `__blog_name`, `__blog_slug`, `__blog_header_image`, `__blog_meta_title`, `__blog_meta_keyword`, `__blog_short_description`, `__blog_description`, `__blog_added_by`, `__blog_status`, `created_at`, `updated_at`) VALUES
(4, 'Why Techno Apogee?', 'why-techno-apogee-limited', 'why-techno-apogee-limited-2023-08-25-00-30-11-487984.jpg', 'Why Techno Apogee', 'designs, installs, and maintains fire protection systems for commercial, industrial, and residential properties. buildings. Services include substation design and installation, busbar trunking', 'Techno Apogee Limited is a leading provider of fire protection, electrical, and automation solutions in Bangladesh. The company was founded in 2006 and is headquartered in Dhaka. Techno Apogee has a team of experienced engineers and technicians who are committed to providing quality services to their clients.\r\n\r\nThe company offers a wide range of services, including:\r\n\r\nFire protection systems: Techno Apogee designs, installs, and maintains fire protection systems for commercial, industrial, and residential properties.\r\nElectrical solutions: Techno Apogee provides electrical solutions for both new and existing buildings. Services include substation design and installation, busbar trunking, and distribution board installation.\r\nAutomation solutions: Techno Apogee provides automation solutions for a variety of industries, including manufacturing, healthcare, and transportation. Services include home automation, security automation, and BMS (Building Management System).\r\nTechno Apogee is a certified member of the Bangladesh Fire Protection Association (BAFPA) and the Bangladesh Automation Society (BAS). The company is also ISO 9001:2015 certified, which ensures that its quality management system meets international standards.\r\n\r\nTechno Apogee has a proven track record of providing quality services to its clients. The company has been involved in a number of high-profile projects, including the installation of fire protection systems for the Bangladesh Parliament Building and the Bangabandhu Sheikh Mujibur Rahman Novo Theatre.\r\n\r\nTechno Apogee is committed to providing its clients with the best possible services. The company is constantly investing in new technologies and training its staff to ensure that they are up-to-date on the latest industry trends.\r\n\r\nIf you are looking for a reliable and experienced provider of fire protection, electrical, and automation solutions in Bangladesh, then Techno Apogee is the company for you. Contact the company today to learn more about their services.\r\n\r\nHere are some of the company\'s notable projects:\r\n\r\nFire protection systems for the Bangladesh Parliament Building\r\nFire protection systems for the Bangabandhu Sheikh Mujibur Rahman Novo Theatre\r\nElectrical solutions for the Bashundhara City Complex\r\nAutomation solutions for the Jamuna Future Park\r\nFire protection systems for the Chittagong Port\r\nElectrical solutions for the Hazrat Shahjalal International Airport\r\nTechno Apogee is a trusted partner of many leading organizations in Bangladesh. The company is committed to providing its clients with the best possible services and solutions.', '<p data-sourcepos=\"1:1-1:310\" style=\"margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Techno Apogee Limited is a leading provider of fire protection, electrical, and automation solutions in Bangladesh. The company was founded in 2006 and is headquartered in Dhaka. Techno Apogee has a team of experienced engineers and technicians who are committed to providing quality services to their clients.</p><p data-sourcepos=\"3:1-3:55\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">The company offers a wide range of services, including:</p><ul data-sourcepos=\"5:1-8:0\" style=\"margin-top: 4px; margin-bottom: 4px; padding-inline-start: 36px; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\"><li data-sourcepos=\"5:1-5:153\" style=\"margin-bottom: 10px;\">Fire protection systems: Techno Apogee designs, installs, and maintains fire protection systems for commercial, industrial, and residential properties.</li><li data-sourcepos=\"6:1-6:211\" style=\"margin-bottom: 10px;\">Electrical solutions: Techno Apogee provides electrical solutions for both new and existing buildings. Services include substation design and installation, busbar trunking, and distribution board installation.</li><li data-sourcepos=\"7:1-8:0\" style=\"margin-bottom: 10px;\">Automation solutions: Techno Apogee provides automation solutions for a variety of industries, including manufacturing, healthcare, and transportation. Services include home automation, security automation, and BMS (Building Management System).</li></ul><p data-sourcepos=\"9:1-9:259\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Techno Apogee is a certified member of the Bangladesh Fire Protection Association (BAFPA) and the Bangladesh Automation Society (BAS). The company is also ISO 9001:2015 certified, which ensures that its quality management system meets international standards.</p><p data-sourcepos=\"11:1-11:302\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Techno Apogee has a proven track record of providing quality services to its clients. The company has been involved in a number of high-profile projects, including the installation of fire protection systems for the Bangladesh Parliament Building and the Bangabandhu Sheikh Mujibur Rahman Novo Theatre.</p><p data-sourcepos=\"13:1-13:229\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Techno Apogee is committed to providing its clients with the best possible services. The company is constantly investing in new technologies and training its staff to ensure that they are up-to-date on the latest industry trends.</p><p data-sourcepos=\"15:1-15:235\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">If you are looking for a reliable and experienced provider of fire protection, electrical, and automation solutions in Bangladesh, then Techno Apogee is the company for you. Contact the company today to learn more about their services.</p><p data-sourcepos=\"17:1-17:48\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Here are some of the company\'s notable projects:</p><ul data-sourcepos=\"19:1-25:0\" style=\"margin-top: 4px; margin-bottom: 4px; padding-inline-start: 36px; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\"><li data-sourcepos=\"19:1-19:64\" style=\"margin-bottom: 10px;\">Fire protection systems for the Bangladesh Parliament Building</li><li data-sourcepos=\"20:1-20:80\" style=\"margin-bottom: 10px;\">Fire protection systems for the Bangabandhu Sheikh Mujibur Rahman Novo Theatre</li><li data-sourcepos=\"21:1-21:55\" style=\"margin-bottom: 10px;\">Electrical solutions for the Bashundhara City Complex</li><li data-sourcepos=\"22:1-22:49\" style=\"margin-bottom: 10px;\">Automation solutions for the Jamuna Future Park</li><li data-sourcepos=\"23:1-23:49\" style=\"margin-bottom: 10px;\">Fire protection systems for the Chittagong Port</li><li data-sourcepos=\"24:1-25:0\" style=\"margin-bottom: 10px;\">Electrical solutions for the Hazrat Shahjalal International Airport</li></ul><p data-sourcepos=\"26:1-26:176\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Techno Apogee is a trusted partner of many leading organizations in Bangladesh. The company is committed to providing its clients with the best possible services and solutions.</p>', '1-Sam Bd', 0, '2023-08-24 18:30:11', '2023-12-06 09:40:32'),
(5, 'About Techno Apogee', 'about-techno-apogee-limited', 'about-techno-apogee-limited-2023-08-25-00-31-11-392161.jpg', 'About Techno Apogee', 'designs, installs, and maintains fire protection systems for commercial, industrial, and residential properties. buildings. Services include substation design and installation, busbar trunking', 'Techno Apogee Limited is a Bangladeshi engineering and technology company that provides fire protection, electrical, and automation solutions. The company was founded in 2006 and is headquartered in Dhaka, Bangladesh.', '<p data-sourcepos=\"3:1-3:217\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Techno Apogee Limited is a Bangladeshi engineering and technology company that provides fire protection, electrical, and automation solutions. The company was founded in 2006 and is headquartered in Dhaka, Bangladesh.</p><p data-sourcepos=\"5:1-5:57\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Techno Apogee offers a wide range of services, including:</p><ul data-sourcepos=\"7:1-10:0\" style=\"margin-top: 4px; margin-bottom: 4px; padding-inline-start: 36px; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\"><li data-sourcepos=\"7:1-7:155\" style=\"margin-bottom: 10px;\">Fire protection systems: The company designs, installs, and maintains fire protection systems, such as fire alarms, sprinkler systems, and fire hydrants.</li><li data-sourcepos=\"8:1-8:185\" style=\"margin-bottom: 10px;\">Electrical solutions: Techno Apogee provides electrical solutions for both residential and commercial buildings, such as substations, power distribution systems, and lighting systems.</li><li data-sourcepos=\"9:1-10:0\" style=\"margin-bottom: 10px;\">Automation solutions: The company provides automation solutions for a variety of industries, such as building automation, industrial automation, and security systems.</li></ul><p data-sourcepos=\"11:1-11:301\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Techno Apogee has a team of experienced engineers and technicians who are committed to providing high-quality services. The company has a proven track record of success and has completed projects for a variety of clients, including government agencies, private companies, and educational institutions.</p><p data-sourcepos=\"13:1-13:209\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Techno Apogee is committed to providing innovative and sustainable solutions to its clients. The company is also committed to providing its employees with opportunities for professional development and growth.</p><p data-sourcepos=\"15:1-15:48\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Here are some of the company\'s notable projects:</p><ul data-sourcepos=\"17:1-20:0\" style=\"margin-top: 4px; margin-bottom: 4px; padding-inline-start: 36px; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\"><li data-sourcepos=\"17:1-17:111\" style=\"margin-bottom: 10px;\">Design and installation of fire protection systems for the Berger Paints Bangladesh Limited factory in Dhaka.</li><li data-sourcepos=\"18:1-18:131\" style=\"margin-bottom: 10px;\">Design and installation of electrical systems for the Bangladesh University of Engineering and Technology (BUET) campus in Dhaka.</li><li data-sourcepos=\"19:1-20:0\" style=\"margin-bottom: 10px;\">Supply and installation of automation systems for the Hazrat Shahjalal International Airport in Dhaka.</li></ul><p data-sourcepos=\"21:1-21:210\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Techno Apogee is a leading provider of fire protection, electrical, and automation solutions in Bangladesh. The company is committed to providing its clients with high-quality services and innovative solutions.</p>', '1-Sam Bd', 0, '2023-08-24 18:31:11', '2023-12-06 09:41:13');
