(62, 'MichaelSnort', 'blacksprut', 'pulcfibucyp1977@mail.ru', 'blacksprut', 'Odysseus lunar lander shares new photos from its harrowing descent \r\n<a href=https://blacksprut2rprrt3aoigwh7zftiprzqyqynzz2eiimmwmykw7wkpyad.at>blacksprut </a> \r\nThe Odysseus spacecraft has dispatched new images it captured of the lunar surface during the lander‚Äôs harrowing approach to the moon. The vehicle softly touched down on the moon on Thursday, becoming the first US-made lander to do so since the Apollo era. \r\n \r\nThe grainy images were shared by Intuitive Machines, the company that developed Odysseus, on Monday morning. The company had initially projected that the lander could deliver the first images captured from the lunar surface in the hours after landing, but communicating with the spacecraft has proven challenging. \r\nhttps://bs2shops.com \r\nblacksprut \r\nThe mission team believes Odysseus tripped on the lunar soil and landed on its side, resting on a rock, which may have left some of the vehicle‚Äôs antennas pointed in an inopportune direction, Intuitive Machines revealed Friday. \r\n \r\nIn its update Monday, the company also said it now expects to lose contact with Odysseus on Tuesday ‚Äî days earlier than initially hoped. \r\n \r\n‚ÄúFlight controllers intend to collect data until the lander‚Äôs solar panels are no longer exposed to light,‚Äù the company said in the update posted on the social media platform X. ‚ÄúBased on Earth and Moon positioning, we believe flight controllers will continue to communicate with Odysseus until Tuesday morning.‚Äù \r\n \r\nAt that point, Odysseus will have been operating less than five days on the lunar surface. The company had suggested in previous updates that the lander could function for up to nine days.', '146.70.111.146', 0, '2024-05-07 01:17:12', '2024-05-07 01:17:12'),
