(71, 'BradleyDah', 'kraken14.at', 'asnecant1980@mail.ru', 'kraken14.at', 'Goats work as caddies at this Oregon ranch \r\n<a href=https://kraken17.at-kraken16.at>kraken2</a> \r\n \r\nTo most, goat is simply the name for a horned ruminant mammal. For those in sporting circles, it‚Äôs a four-letter acronym bestowed upon the greatest of all time. \r\n \r\nVenture through the myriad pine forests and winding creeks into the Blue Mountains of Eastern Oregon though, and both apply simultaneously. \r\n \r\nhttps://at-kraken17.at \r\nkraken13.at \r\nSilvies Valley Ranch offers a slice of Wild West luxury to travelers and ‚Äì for the golfers among them ‚Äì the opportunity to be caddied for by a rigorously trained team of goats. \r\n \r\nA world first when launched in 2018, the current team is the best to ever do it, as far as Silvies owner Dr. Scott Campbell is concerned ‚Äì and they have even convinced some initial skeptics. \r\n \r\n‚ÄúA lot of people said it was a stupid idea,‚Äù Campbell told CNN. \r\n \r\n‚ÄúThey thought it would make people call us a goat track. Nothing could be further from the truth. Everybody has a good time ‚Ä¶ People come from all over the world.‚Äù \r\n \r\nNew career path \r\nThe radical setup was born from a practical problem. \r\n \r\nMcVeigh‚Äôs Gauntlet ‚Äì Silvies‚Äô seven-hole challenge course ‚Äì was far too steep for golf carts to safely traverse. With players only requiring a few clubs to play the course, carrying such a load was well within the capabilities of the ranch‚Äôs 3,000 grazers, whose ancestors were transporting cargo long before golfers were planting tees. \r\n \r\n‚ÄúThe goats were asking for different career opportunities, and as an equal opportunity employer, we developed a new career path for them,‚Äù Campbell joked. \r\n \r\nA three-month evaluation process sees potential caddies as young as six months old scouted on their friendliness and physical aptitude. Those that progress to the next stage are fitted with a custom-made golf bag ‚Äì tailored by Oregon-based company Seamus Golf ‚Äì to see if they‚Äôre comfortable carrying it. \r\n \r\nThe bag is near-empty for training, but for full-time caddies contains six clubs, extra balls and tees, six drink cans and their daily wage: a few dozen peanuts. \r\n \r\nChosen candidates are taught the course and put on a carefully monitored physical and nutrition regime before starting their new role from two years old, working six-hour shifts three to four days a week. An on-site vet visits the caddy shack ‚Äì situated next to the club house and open to visitors throughout the day ‚Äì on a weekly basis. \r\n \r\nEight goats make up today‚Äôs caddie team ‚Äì Chunky, Mulligan, Harry, Bogey, Birdie, Charlie, Carrot and Jack ‚Äì with nine yearlings in training and 10 three-month-old prospects waiting in the wings.', '37.19.217.100', 0, '2024-07-29 14:22:20', '2024-07-29 14:22:20'),
