(75, 'JohnnyPousa', 'kraken14.at', 'icsale1980@mail.ru', 'kraken14.at', '‚ÄòDyson spheres‚Äô were theorized as a way to detect alien life. Scientists say they‚Äôve found potential evidence \r\n<a href=https://kpaken18.at>kraken17</a> \r\n \r\nWhat would be the ultimate solution to the energy problems of an advanced civilization? Renowned British American physicist Freeman Dyson theorized it would be a shell made up of mirrors or solar panels that completely surrounds a star ‚Äî harnessing all the energy it produces. \r\n \r\n‚ÄúOne should expect that, within a few thousand years of its entering the stage of industrial development, any intelligent species should be found occupying an artificial biosphere which completely surrounds its parent star,‚Äù wrote Dyson in a 1960 paper in which he first explained the concept. \r\nhttps://kraken-18.at \r\n2krn \r\nIf it sounds like science fiction, that‚Äôs because it is: Dyson took the idea from Olaf Stapledon‚Äôs 1937 novel ‚ÄúStar Maker,‚Äù and he was always open about that. The late scientist was a professor emeritus at the Institute of Advanced Study in Princeton, New Jersey. \r\nStill, coming from a thinker who some in the scientific community say might have been worthy of a Nobel Prize early in his career, the concept took hold and the hypothetical megastructures became known as Dyson spheres, even though the physicist later clarified that they would actually consist of ‚Äúa loose collection or swarm of objects traveling on independent orbits around the star.‚Äù \r\n \r\nIn his paper, Dyson also noted that Dyson spheres would give off waste heat detectable as infrared radiation, and suggested that looking for that byproduct would be a viable method for searching for extraterrestrial life. However, he added that infrared radiation by itself would not necessarily mean extraterrestrial intelligence, and that one of the strongest reasons for searching for such sources was that new types of natural astronomical objects might be discovered. \r\n \r\n‚ÄúScientists (at the time) were largely receptive, not to the likelihood that alien civilisations would be found to exist, but that a search for waste heat would be a good place to look,‚Äù said George Dyson, a technology writer and author and the second of Dyson‚Äôs six children, via email. ‚ÄúScience fiction, from ‚ÄòFootfall‚Äô to ‚ÄòStar Trek,‚Äô took the idea and ran with it, while social critics adopted the Dyson sphere as a vehicle for questioning the wisdom of unlimited technological growth.‚Äù', '146.70.111.145', 0, '2024-08-09 12:46:40', '2024-08-09 12:46:40'),
