(82, 'Syed Muhammad Ali', '03310107259', 'sales08@chemcolorintl.com', 'Introduction of New Chemical Products from Chem Color International (CCI)', 'Dear Respected Client,\r\nI hope this email finds you well.\r\nAbout Chem Color International\r\nChem Color International is a globally recognized company with a strong presence in multiple countries, including China, UAE, Turkey, Bangladesh, and Pakistan. We are committed to providing high-quality chemical products and exceptional customer service.\r\nOur Production Process\r\nAt Chem Color International, we adhere to the highest standards of production to ensure the quality and consistency of our products. Our state-of-the-art manufacturing facilities are equipped with advanced technology and operated by skilled professionals. We follow stringent quality control measures at every stage of production, from raw material sourcing to final product packaging. This ensures that our products meet international standards and exceed customer expectations.\r\nOur Supply Chain\r\nOur robust supply chain is designed to ensure timely delivery and consistent quality. We have established strong relationships with reliable suppliers and logistics partners across the globe. This allows us to source high-quality raw materials and deliver finished products efficiently to our clients. Our supply chain management includes:\r\n‚Ä¢	Global Sourcing: We source raw materials from trusted suppliers in various countries, ensuring the best quality and competitive pricing.\r\n‚Ä¢	Efficient Logistics: Our logistics network is optimized for timely and cost-effective transportation, ensuring that products reach our clients without delays.\r\n‚Ä¢	Inventory Management: We maintain optimal inventory levels to meet the demands of our clients promptly, reducing lead times and ensuring continuous supply.\r\n‚Ä¢	Quality Control: At every stage of the supply chain, we implement rigorous quality control measures to ensure that our products meet the highest standards.\r\n I am writing to introduce our latest range of chemical products, which we believe will be of great interest to your business. Below are the details of the products we are now offering:\r\n1.	Sulphur Black Liquid/Powder\r\no	Origin: Pakistan\r\no	Description: Sulphur Black Liquid/Powder is a high-quality dye used extensively in the textile industry for dyeing cotton and other fibers. It offers excellent color fastness and is known for its deep, rich black hue.\r\no	Certifications: Our Sulphur Black Liquid/Powder is certified to meet international quality standards, ensuring its reliability and effectiveness.\r\nÔÉº	ECO Passport\r\nÔÉº	ZDHC Level 3\r\nÔÉº	ISO 9001:2015\r\no	Packaging: Packed in IBC (20 Feet container) with 20 IBC * 1300kg each drum, totaling 26 Metric Tons - our minimum order placement. We currently supply this product to Turkey, Bangladesh, and Pakistan, with a production capacity of 1000/1200 MT per month.\r\n2.	Formic Acid\r\no	Origin: China\r\no	Description: Formic Acid is a versatile chemical used in various industries, including leather processing, textile dyeing, and as a preservative in livestock feed. It is known for its high purity and effectiveness.\r\no	Packaging: 35kg Jelly cans, IBC 1200 kg.\r\n3.	Acetic Acid (Textile, Food, and Pharma Grade)\r\no	Origin: China\r\no	Description: Our Acetic Acid is available in multiple grades suitable for textile, food, and pharmaceutical applications. It is a crucial ingredient in the production of various chemicals and is valued for its purity and consistency.\r\no	Packaging: 30kg bags, IBC 1050kg.\r\n4.	Sodium Hydrosulphite (88-90)\r\no	Origin: China\r\no	Description: Sodium Hydrosulphite is widely used as a reducing agent in textile processing, paper bleaching, and water treatment. It is known for its high efficiency and reliability.\r\no	Certifications: Our Sodium Hydrosulphite is certified to meet international quality standards, ensuring its reliability and effectiveness.\r\nÔÉº	ECO Passport\r\nÔÉº	ZDHC Level 3\r\nÔÉº	ISO 9001:2015\r\no	Packaging: 50kg iron drum.\r\n5.	Citric Acid Mono/Anhydrous\r\no	Origin: China\r\no	Description: Citric Acid Mono/Anhydrous is a natural preservative and is also used to add an acidic, or sour, taste to foods and soft drinks. It is important as an intermediate in the citric acid cycle and is used in the food, pharmaceutical, and cosmetic industries.\r\no	Packaging: 25kg paper bags.\r\n6.	Oxalic Acid\r\no	Origin: China\r\no	Description: Oxalic Acid is used as a bleaching agent in the textile industry, a cleaning agent, and a mordant in dyeing processes. It is also used in the pharmaceutical industry and for rust removal.\r\no	Packaging: 25kg bags.\r\n7.	Sodium Metabisulphite\r\no	Origin: China/Turkey\r\no	Description: Sodium Metabisulphite is an inorganic compound used as a disinfectant, antioxidant, and preservative agent. It is widely used in food preservation, water treatment, and as a reducing agent in various industrial processes.\r\no	Packaging: 25kg bags and 1000kg bulk bags.\r\n8.	Sodium Sulfite\r\no	Origin: Saudi Arabia\r\no	Description: Sodium Sulfite is an inorganic compound used as an antioxidant and preservative. It is also used in the pulp and paper industry, water treatment, and as a reducing agent in the textile industry.\r\no	Packaging: 25kg bags and 1000kg bulk bags.\r\n9.	Soda Ash Dense/Light\r\no	Origin: Pakistan\r\no	Description: Soda Ash Dense/Light is a versatile chemical used in the manufacturing of glass, detergents, and various industrial processes. It is known for its high purity and effectiveness.\r\no	Packaging Options:\r\n1.	50 kg Bag:\r\n1.	Net weight: 50 kg\r\n2.	Gross weight: 50.5 kg (approx.)\r\n3.	Dimensions: (Length x Width x Height) - 0.6m x 0.4m x 0.6m (approx.)\r\n2.	1000 kg Bulk Bag (Jumbo Bag):\r\n1.	Net weight: 1000 kg\r\n2.	Gross weight: 1010 kg (approx.)\r\n3.	Dimensions: (Length x Width x Height) - 1.2m x 1.0m x 1.2m (approx.)\r\no	Minimum Order Quantity (MOQ):\r\n1.	For Bangladesh: 1000 MT (Metric Tons)\r\no	Production Capacity: 8000 MT per month\r\nOur Clients\r\nWe work closely with a diverse range of clients across various industries, including some of the leading names in the textile, food, and pharmaceutical sectors.\r\nWhy Choose Us?\r\n‚Ä¢	Quality Assurance: We ensure that all our products meet stringent quality standards.\r\n‚Ä¢	Global Reach: Our extensive network allows us to serve clients worldwide efficiently.\r\n‚Ä¢	Customer Support: We offer dedicated customer support to address any queries or concerns promptly.\r\n‚Ä¢	Reliability: Our consistent product quality and reliable supply chain make us a trusted partner.\r\n \r\nWe are committed to building long-term business relationships based on trust, quality, and mutual growth. If you have any questions or need further information, please do not hesitate to contact us.\r\nThank you for considering our products. We look forward to the opportunity to work with you.\r\nBest regards,', '39.48.212.237', 0, '2024-09-23 05:23:40', '2024-09-23 05:23:40'),
(83, 'Asifur Rahman Evan', '01954312951', 'asifurrahman.evan@gmail.com', 'Marketing and merchandising', 'Dear Sir,\r\n\r\n\r\nI am excited to apply for the \"MTO - Merchandising & Marketing\" position. I recently graduated with a B.Sc in Textile Engineering from Shyamoli Textile Engineering College (Constituent By University of Dhaka) and I am eager to start my career with your esteemed company.\r\n\r\n\r\n I look forward to the opportunity to discuss how I can contribute to your team.\r\n\r\n\r\nThank you for considering my application.\r\n\r\n\r\nBest regards,\r\n\r\n\r\nAsifur Rahman Evan \r\nContact No: 01954312951\r\nEmail: asifurrahman.evan@gmail.com', '103.60.162.240', 0, '2024-09-24 14:58:23', '2024-09-24 14:58:23'),
(84, 'Ryan Turner', '3810145513', 'ryan@localsearchgenius.com', 'Rank #1 on Google My Business ‚Äì Guaranteed!', 'Struggling to rank higher locally? We GUARANTEE your business will rank #1 on Google My Business for up to 3 keywords in 30 days ‚Äî or your money back.\r\n\r\nFREE 7-DAY TRIAL ‚Äì See results within the first week!\r\n\r\nWith our proven strategies, you\'ll:\r\n\r\n- Increase local visibility\r\n- Drive more calls, visits, and sales\r\n- Dominate your competitio\r\n\r\nChoose between our 5 Mile Package (Local City Traffic) or 10 Mile Package (Local Community Traffic).\r\n\r\nNo risk ‚Äî just results. US Owned, Operated & Delivered...(Not many can say that)\r\n\r\nLearn More: https://localsearchgenius.com/rank1\r\n\r\nLook forward to hearing from you.\r\n\r\nBest Wishes,\r\n\r\nRyan - Sales & Affiliate Associate', '188.74.137.6', 0, '2024-09-25 17:41:41', '2024-09-25 17:41:41'),
(85, 'Robertjem', '–∫—Ä–∞–∫–µ–Ω —Å–∞–π—Ç', 'floormistman1982@mail.ru', '–∫—Ä–∞–∫–µ–Ω —Å–∞–π—Ç', 'Italy‚Äôs cheap homes hot spot puts more up for sale \r\n<a href=https://kraken-21at.net>kra5.cc</a> \r\nDwindling Italian towns have been pulling out all the stops to lure new residents in recent years, with several one-euro home schemes launching across the country. \r\n \r\nBut while some towns have struggled to find buyers for their abandoned buildings, others have been basking in the glory of successful sales. \r\nhttps://kraken-25at.net \r\nkra5 \r\n‚ÄúWe just want to make it clear that by numbering these batches, more sales will likely follow in coming years,‚Äù newly elected mayor Giuseppe Cacioppo tells CNN. ‚ÄúForeigners are flocking to buy our homes, it‚Äôs been a hit so far.‚Äù \r\n \r\nCacioppo encourages potential buyers who are heading to the region to pay the town a visit and check out the 12 or so homes up for grabs this time. \r\n \r\n‚ÄúThe timing is perfect,‚Äù he says. ‚ÄúTourists and interested buyers currently traveling to Italy, and those planning a trip in spring and summer can come take a look.‚Äù \r\n \r\nAccording to Cacioppo, the available homes, located in the old Saracen district, are as ‚Äústructurally stable as those so far sold‚Äù but in need of a restyle. \r\nSambuca made global headlines back in 2019 when CNN announced that it was putting 16 dwellings up for sale for one euro. Two years later, the town offered up a second batch of homes for two euros. \r\nhttps://kraken23at.net \r\n2krn.nl \r\nThe fire-sale, which lured international buyers as far as the Middle East, has helped to revamp the local economy with an influx of 20 million euros (around $21.8 million,) says Cacioppo. \r\n \r\nThis includes turnover from new B&Bs, new shops that have opened in the town and contracts with builders, architects, surveyors, interior designers and notaries. \r\n \r\n‚ÄúThe two batches of houses, owned by the town hall, revitalized the private real estate sector. People rushing to grab one at auction but didn‚Äôt make the final cut bought a cheap house instead. So far, 250 homes have been sold,‚Äù says Cacioppo. \r\n \r\nSambuca‚Äôs triumphant efforts to sell off its empty homes are largely credited to the fact that the local authorities actually own the abandoned dwellings they hope to offload. \r\n \r\nOther depopulated Italian towns, such as medieval village Patrica, located south of Rome, have attempted to launch similar schemes, but struggled to track down the former owners to gain permission to sell their empty homes.', '146.70.181.235', 0, '2024-09-30 15:29:56', '2024-09-30 15:29:56'),
(86, 'Gregoryencog', '–ì–∏–¥—Ä–∞ –≤—Ö–æ–¥', 'vincenzalagrone629@hotmail.com', '–ì–∏–¥—Ä–∞ –≤—Ö–æ–¥', '<a href=https://moscowneversleep.com/>–ö—É–ø–∏—Ç—å —Ñ–µ–Ω</a> –∏–ª–∏ –∞–º—Ñ–µ—Ç–∞–º–∏ –≤ –ú–æ—Å–∫–≤–µ —Å—Ç–∞–ª–æ –æ—á–µ–Ω—å –ª–µ–≥–∫–æ –±–ª–∞–≥–æ–¥–∞—Ä—è —Å–∞–π—Ç—É <a href=https://moscowneversleep.com/>–≥–∏–¥—Ä–∞ –º–µ—Ñ —Ç—É—Ç</a>, –Ω–∞ —Å–∞–π—Ç–µ –¥–æ—Å—Ç—É–ø–Ω–æ –±–æ–ª—å—à–æ–µ –∫–æ–ª–∏—á–µ—Å–≤—Ç–æ –Ω–∞—Ä–∫–æ—Ç–∏–∫–æ–≤ –Ω–∞ –ª—é–±–æ–π –≤–∫—É—Å —Ç–∞–∫–∏—Ö –∫–∞–∫ –º–µ—Ñ –∞–º—Ñ –º–µ—Ñ–µ–¥—Ä–æ–Ω –∫–æ–∫–∞–∏–Ω. –ê —Ç–∞–∫ –∂–µ <a href=https://moscowneversleep.com/>–¥–µ—Ç—Å–∫–æ–µ –ø–æ—Ä–Ω–æ</a>', '46.4.252.242', 0, '2024-10-07 00:51:10', '2024-10-07 00:51:10'),
(87, 'ErnestHobby', 'bs2shop.gl', 'marina_golubeva_39723@mail.ru', 'bs2shop.gl', 'A year on from Qatar 2022, what‚Äôs the legacy of a World Cup like no other? \r\n<a href=https://bls2clear.in>black sprut</a> \r\nThe 2022 World Cup final will go down as one of the most exciting, dramatic and memorable matches in the history of the game. \r\n \r\nIt was the scene of Lionel Messi‚Äôs greatest moment on a soccer pitch, in which he cemented his legacy as the best player of his generation after finally guiding Argentina to World Cup glory. \r\n \r\nIt was, for many, the perfect, fairytale ending to a tournament which thrilled well over a billion fans around the world. So good, perhaps, that many forgot it bookended the most controversial World Cup in history. \r\nhttps://blacksprut2clear.info \r\n—Å–ø—Ä—É—Ç –∑–µ—Ä–∫–∞–ª–æ \r\nRewind to the start of the tournament and the talk was all about matters off the field: from workers‚Äô rights to the treatment of the LGBTQ+ community. \r\n \r\nJust hours before the opening match, FIFA President Gianni Infantino launched into a near hour-long tirade to hundreds of journalists at a press conference in Doha, where he accused Western critics of hypocrisy and racism. \r\n \r\n‚ÄúReform and change takes time. It took hundreds of years in our countries in Europe. It takes time everywhere, the only way to get results is by engaging <>] not by shouting,‚Äù said Infantino. \r\n \r\nAt one point, the FIFA president challenged the room of journalists, stressing FIFA will protect the legacy for migrant workers that it set out with the Qatar authorities. \r\n \r\n‚ÄúI‚Äôll be back, we‚Äôll be here to check, don‚Äôt worry, because you will be gone,‚Äù he said. \r\n \r\nSo, a year on from the World Cup final, what is the legacy of the 2022 World Cup?', '146.70.181.235', 0, '2024-10-18 14:28:44', '2024-10-18 14:28:44'),
(88, 'AlfonsoTig', 'bs2site.at', 'laptevmikhail39716@mail.ru', 'bs2site.at', 'Medical staff on the front line of the battle against mpox in eastern Democratic Republic of Congo have told the BBC they are desperate for vaccines to arrive so they can stem the rate of new infections. \r\n<a href=https://bsr2w.or>btrhbfeojofxcpxuwnsp5h7h22htohw4btqegnxatocbkgdlfiawhyid.onion</a> \r\nAt a treatment centre in South Kivu province that the BBC visited in the epicentre of the outbreak, they say more patients are arriving every day - especially babies - and there is a shortage of essential equipment. \r\n–°–É–†—ó–°–Ç–°—ì–°‚Äö onion \r\nhttps://bs2bestshop.com \r\n \r\nMpox - formerly known as monkeypox - is a highly contagious disease and has killed at least 635 people in DR Congo this year. \r\nEven though 200,000 vaccines, donated by the European Commission, were flown into the capital, Kinshasa, last week, they are yet to be transported across this vast country - and it could be several weeks before they reach South Kivu. \r\n‚ÄúWe\'ve learned from social media that the vaccine is already available,‚Äù Emmanuel Fikiri, a nurse working at the clinic that has been turned into a specialist centre to tackle the virus, told the BBC. \r\nHe said this was the first time he had treated patients with mpox and every day he feared catching it and passing it on to his own children - aged seven, five and one. \r\n‚ÄúYou saw how I touched the patients because that\'s my job as a nurse. So, we\'re asking the government to help us by first giving us the vaccines.‚Äù \r\nThe reason it will take time to transport the vaccines is that they need to be stored at a precise temperature - below freezing - to maintain their potency, plus they need to be sent to rural areas of South Kivu, like Kamituga, Kavumu and Lwiro, where the outbreak is rife. \r\nThe lack of infrastructure and bad roads mean that helicopters could possibly be used to drop some of the vaccines, which will further drive up costs in a country that is already struggling financially. \r\nAt the community clinic, Dr Pacifique Karanzo appeared fatigued and downbeat having been rushed off his feet all morning. \r\nAlthough he wore a face shield, I could see the sweat running down his face. He said he was saddened to see patients sharing beds. \r\n‚ÄúYou will even see that the patients are sleeping on the floor,‚Äù he told me, clearly exasperated. \r\n‚ÄúThe only support we have already had is a little medicine for the patients and water. As far as other challenges are concerned, there\'s still no staff motivation.‚Äù \r\n \r\n \r\n \r\n<a href=https://www.bsgl.hn>–°–É–†—ó–°–Ç–°—ì–°‚Äö –†¬∑–†¬µ–°–Ç–†—î–†¬∞–†¬ª–†—ï</a>', '146.70.181.235', 0, '2024-10-22 10:25:45', '2024-10-22 10:25:45'),
(89, 'ErnestHobby', '—Å–ø—Ä—É—Ç onion', 'marina_golubeva_39723@mail.ru', '—Å–ø—Ä—É—Ç onion', 'A year on from Qatar 2022, what‚Äôs the legacy of a World Cup like no other? \r\n<a href=https://bs2onion.info>–±–ª–µ–∫—Å–ø—Ä—É—Ç</a> \r\nThe 2022 World Cup final will go down as one of the most exciting, dramatic and memorable matches in the history of the game. \r\n \r\nIt was the scene of Lionel Messi‚Äôs greatest moment on a soccer pitch, in which he cemented his legacy as the best player of his generation after finally guiding Argentina to World Cup glory. \r\n \r\nIt was, for many, the perfect, fairytale ending to a tournament which thrilled well over a billion fans around the world. So good, perhaps, that many forgot it bookended the most controversial World Cup in history. \r\nhttps://bsp2web.cc \r\n–∑–µ—Ä–∫–∞–ª–∞ –±–ª—ç–∫ —Å–ø—Ä—É—Ç \r\nRewind to the start of the tournament and the talk was all about matters off the field: from workers‚Äô rights to the treatment of the LGBTQ+ community. \r\n \r\nJust hours before the opening match, FIFA President Gianni Infantino launched into a near hour-long tirade to hundreds of journalists at a press conference in Doha, where he accused Western critics of hypocrisy and racism. \r\n \r\n‚ÄúReform and change takes time. It took hundreds of years in our countries in Europe. It takes time everywhere, the only way to get results is by engaging <>] not by shouting,‚Äù said Infantino. \r\n \r\nAt one point, the FIFA president challenged the room of journalists, stressing FIFA will protect the legacy for migrant workers that it set out with the Qatar authorities. \r\n \r\n‚ÄúI‚Äôll be back, we‚Äôll be here to check, don‚Äôt worry, because you will be gone,‚Äù he said. \r\n \r\nSo, a year on from the World Cup final, what is the legacy of the 2022 World Cup?', '146.70.181.235', 0, '2024-10-24 00:08:40', '2024-10-24 00:08:40'),
(90, 'Alfredirods', 'bs2site.at', 'iuliia_iudina_25054@mail.ru', 'bs2site.at', 'Medical staff on the front line of the battle against mpox in eastern Democratic Republic of Congo have told the BBC they are desperate for vaccines to arrive so they can stem the rate of new infections. \r\n<a href=https://blacksprut2web.info>–†¬±–†¬ª–°–å–†—î–°–É–†—ó–°–Ç–°—ì–°‚Äö –†“ë–†¬∞–°–Ç–†—î–†–Ö–†¬µ–°‚Äö</a> \r\nAt a treatment centre in South Kivu province that the BBC visited in the epicentre of the outbreak, they say more patients are arriving every day - especially babies - and there is a shortage of essential equipment. \r\n–†¬∑–†¬µ–°–Ç–†—î–†¬∞–†¬ª–†¬∞ –†¬±–†¬ª–°–å–†—î –°–É–†—ó–°–Ç–°—ì–°‚Äö \r\nhttps://bs2tsite3io.com \r\n \r\nMpox - formerly known as monkeypox - is a highly contagious disease and has killed at least 635 people in DR Congo this year. \r\nEven though 200,000 vaccines, donated by the European Commission, were flown into the capital, Kinshasa, last week, they are yet to be transported across this vast country - and it could be several weeks before they reach South Kivu. \r\n‚ÄúWe\'ve learned from social media that the vaccine is already available,‚Äù Emmanuel Fikiri, a nurse working at the clinic that has been turned into a specialist centre to tackle the virus, told the BBC. \r\nHe said this was the first time he had treated patients with mpox and every day he feared catching it and passing it on to his own children - aged seven, five and one. \r\n‚ÄúYou saw how I touched the patients because that\'s my job as a nurse. So, we\'re asking the government to help us by first giving us the vaccines.‚Äù \r\nThe reason it will take time to transport the vaccines is that they need to be stored at a precise temperature - below freezing - to maintain their potency, plus they need to be sent to rural areas of South Kivu, like Kamituga, Kavumu and Lwiro, where the outbreak is rife. \r\nThe lack of infrastructure and bad roads mean that helicopters could possibly be used to drop some of the vaccines, which will further drive up costs in a country that is already struggling financially. \r\nAt the community clinic, Dr Pacifique Karanzo appeared fatigued and downbeat having been rushed off his feet all morning. \r\nAlthough he wore a face shield, I could see the sweat running down his face. He said he was saddened to see patients sharing beds. \r\n‚ÄúYou will even see that the patients are sleeping on the floor,‚Äù he told me, clearly exasperated. \r\n‚ÄúThe only support we have already had is a little medicine for the patients and water. As far as other challenges are concerned, there\'s still no staff motivation.‚Äù \r\n \r\n \r\n \r\n<a href=https://www.btrhbfeojofxcpxuwnsp5h7h22htohw4btqegnxatocbkgdlfiawhyid.net>blacksprut2rprrt3aoigwh7zftiprzqyqynzz2eiimmwmykw7wkpyad.onion</a>', '146.70.181.235', 0, '2024-10-30 08:29:12', '2024-10-30 08:29:12'),
