(1, 'Design & Consultancy Service', 'design-consultancy-service', NULL, 'design-and-consultancy-services', 'design-consultancy-service-design-and-consultancy-services-2023-08-14-16-11-58-989729.jpg', 'Any type of Engineering work starts with a specific design, and an effective design can  ensure the desired functionalities and save money. We have been working in the field  of Design Consultancy of Fire Safety, Electrical and Automation. Apogee Consultancy  is the enlisted consultant of the Fire Service and Civil Defence (FSCD) and Department  of Inspection for Factories and Establishment (DIFE)', 'Any type of Engineering work starts with a specific design, and an effective design can \r\nensure the desired functionalities and save money. We have been working in the field \r\nof Design Consultancy of Fire Safety, Electrical and Automation. Apogee Consultancy \r\nis the enlisted consultant of the Fire Service and Civil Defonce (FSCD) and Department \r\nof Inspection for Factories and Establishment (DIFE)', '12-Techno Apogee', 2, '2023-08-14 10:11:59', '2023-10-07 06:26:51'),
(3, 'Electrical Safety & Fire Safety Audit', 'electrical-fire-safety-audit-consultancy-dife', 'Electrical Safety & Fire Safety Audit in Bangladesh', 'design-and-consultancy-services', 'electrical-fire-safety-audit-consultancy-dife-design-and-consultancy-services-2023-08-14-16-13-01-173238.jpg', 'Techno Apogee is founded by a group of engineers and consultants, who have experience in Architectural, Electrical, Electro-Mechanical, and Communication (IT) design, drawing, project supervision at the national level by the Following BNBC, NFPA, VDE, BS, IEC code. As an Enlisted Consultants of DIFE (The Department of Inspection for Factories and Establishments), we provide consultancy, design, and accredited checking services with expertise and  contributed to the development in Electrical & Fire Safety in Industrial Sector by Electrical & Fire Safety Audit & Risk Assessment', '<p><span style=\"color: rgb(122, 122, 122); font-family: Roboto, sans-serif;\">Techno Apogee is founded by a group of engineers and consultants, who have experience in Architectural, Electrical, Electro-Mechanical, and Communication (IT) design, drawing, and project supervision at the national level by the Following BNBC, NFPA, VDE, BS, IEC code. As Enlisted Consultants of DIFE (The Department of Inspection for Factories and Establishments), we provide consultancy, design, and accredited checking services with expertise and &nbsp;contributed to the development of Electrical &amp; Fire Safety in Industrial Sector through Electrical &amp; Fire Safety Audit &amp; Risk Assessment&nbsp;</span><br></p>', '1-Sam Dev', 1, '2023-08-14 10:13:01', '2023-12-13 06:38:37'),
(4, 'Consultancy for DIFE & Other authority Approval', 'consultancy-for-dife-other-authority-approval', 'Consultancy for DIFE & Other authority Approval in Bangladesh', 'design-and-consultancy-services', 'consultancy-for-dife-other-authority-approval-design-and-consultancy-services-2023-09-03-13-27-43-695659.jpg', 'HVAC, Heating, Ventilation, and Air Conditioning, system,component, building, hvac, techno apogee, techno, apogee, apogee limited,', '<p data-sourcepos=\"1:1-1:150\" style=\"margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#000000\">Consultancy for DIFE &amp; Other authority Approval is a broad term that can refer to a variety of services. Some of the most common services include:</font></span></p><ul data-sourcepos=\"3:1-8:0\" style=\"margin-top: 4px; margin-bottom: 4px; padding-inline-start: 36px; font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\"><li data-sourcepos=\"3:1-3:144\" style=\"margin-bottom: 10px;\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#000000\">Reviewing and preparing DIFE applications:&nbsp;This includes ensuring that the application is complete and meets all of the required criteria.</font></span></li><li data-sourcepos=\"4:1-4:157\" style=\"margin-bottom: 10px;\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#000000\">Providing guidance on the DIFE process:&nbsp;This can include explaining the different stages of the process, as well as the documentation that is required.</font></span></li><li data-sourcepos=\"5:1-5:161\" style=\"margin-bottom: 10px;\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#000000\">Negotiating with DIFE and other authorities:&nbsp;This can involve representing the client\'s interests and ensuring that they receive the best possible outcome.</font></span></li><li data-sourcepos=\"6:1-6:170\" style=\"margin-bottom: 10px;\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#000000\">Monitoring the progress of DIFE applications:&nbsp;This can involve tracking the progress of the application and ensuring that it is completed on time and within budget.</font></span></li><li data-sourcepos=\"7:1-8:0\" style=\"margin-bottom: 10px;\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#000000\">Advising on compliance with DIFE and other regulations:&nbsp;This can include ensuring that the client\'s activities are in compliance with the relevant regulations.</font></span></li></ul><p data-sourcepos=\"9:1-9:243\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#000000\">The specific services that are required will vary depending on the specific project or situation. However, a good consultancy firm will be able to provide a wide range of services to help clients navigate the DIFE and other approval processes.</font></span></p><p data-sourcepos=\"11:1-11:99\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#000000\">Here are some of the benefits of hiring a consultancy firm for DIFE &amp; Other authority Approval:</font></span></p><ul data-sourcepos=\"13:1-17:0\" style=\"margin-top: 4px; margin-bottom: 4px; padding-inline-start: 36px; font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\"><li data-sourcepos=\"13:1-13:82\" style=\"margin-bottom: 10px;\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#000000\">They have the expertise and experience to help you navigate the complex process.</font></span></li><li data-sourcepos=\"14:1-14:78\" style=\"margin-bottom: 10px;\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#000000\">They can save you time and money by handling the paperwork and negotiations.</font></span></li><li data-sourcepos=\"15:1-15:82\" style=\"margin-bottom: 10px;\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#000000\">They can help you to avoid mistakes that could delay or jeopardize your project.</font></span></li><li data-sourcepos=\"16:1-17:0\" style=\"margin-bottom: 10px;\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#000000\">They can provide you with peace of mind knowing that your project is in good hands.</font></span></li></ul><p data-sourcepos=\"18:1-18:251\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#000000\">If you are considering applying for DIFE funding or other government approvals, it is a good idea to hire a consultancy firm to help you. They can help you to increase your chances of success and avoid the costly mistakes that can derail your project.</font></span></p><p data-sourcepos=\"20:1-20:111\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#000000\">Here are some of the things to look for when hiring a consultancy firm for DIFE &amp; Other authority Approval:</font></span></p><ul data-sourcepos=\"22:1-26:0\" style=\"margin-top: 4px; margin-bottom: 4px; padding-inline-start: 36px; font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\"><li data-sourcepos=\"22:1-22:119\" style=\"margin-bottom: 10px;\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#000000\">Experience: The firm should have experience in the specific area of DIFE and other approvals that you need help with.</font></span></li><li data-sourcepos=\"23:1-23:104\" style=\"margin-bottom: 10px;\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#000000\">Expertise: The firm should have the expertise to understand your project and the relevant regulations.</font></span></li><li data-sourcepos=\"24:1-24:89\" style=\"margin-bottom: 10px;\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#000000\">References: Ask for references from previous clients to get an idea of the firm\'s work.</font></span></li><li data-sourcepos=\"25:1-26:0\" style=\"margin-bottom: 10px;\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#000000\">Fees: Get quotes from several firms to compare prices.</font></span></li></ul>', '1-Sam Dev', 1, '2023-09-03 07:27:43', '2023-12-13 06:37:35'),
(5, 'NOC & Fire Safety Plan for FSCD', 'noc-fire-safety-plan-for-fscd', 'NOC & Fire Safety Plan for FSCD in Bangladesh', 'design-and-consultancy-services', 'noc-fire-safety-plan-for-fscd-design-and-consultancy-services-2023-08-14-16-33-54-156934.jpg', 'Techno Apogee is a leading Creator, Developer, and Integrator of energy efficiency and infrastructure renewal solutions in support of economic and environmental sustainability', '<p><span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 12pt; line-height: 18.4px; font-family: Arial, sans-serif; color: rgb(16, 16, 16);\">Techno Apogee is founded by a group of engineers and consultants, who have experience in Architectural, Electrical, Electro-Mechanical, and Communication (IT) design, drawing, project supervision at the national level by the Following&nbsp;<a href=\"https://bsa.com.bd/cms_cpanel/upload/pdf_file_upload__1540152875.pdf\" target=\"_blank\" rel=\"noopener\" style=\"color: rgb(37, 37, 37); transition: all 0.3s ease 0s; outline: 0px; cursor: pointer; box-shadow: none;\"><span style=\"font-weight: bolder;\">BNBC</span></a>,&nbsp;<a href=\"https://www.nfpa.org/\" target=\"_blank\" rel=\"noopener\" style=\"color: rgb(37, 37, 37); transition: all 0.3s ease 0s; cursor: pointer; box-shadow: none; outline: none !important;\"><span style=\"font-weight: bolder;\">NFPA</span></a>, VDE, BS, IEC code. As an Enlisted Consultants of&nbsp;<a href=\"http://www.fireservice.gov.bd/\" target=\"_blank\" rel=\"noopener\" style=\"color: rgb(37, 37, 37); transition: all 0.3s ease 0s; cursor: pointer; box-shadow: none; outline: none !important;\"><span style=\"font-weight: bolder;\">FSCD&nbsp;</span></a>(Bangladesh Fire Service &amp; Civil Defense), we provide consultancy, design, and accredited checking services with expertise and contributed to the development in NOC &amp; Fire Safety Plan in Industrial, Commercial, Residential&nbsp; Sector by NOC (Non-Objection Certificate ) &amp;</span><a href=\"https://technoapogee.com/en/product-and-service/noc-fire-safety-plan-for-fscd\" target=\"_blank\" rel=\"noopener\" style=\"color: rgb(37, 37, 37); transition: all 0.3s ease 0s; font-family: var( --e-global-typography-text-font-family ), Sans-serif; cursor: pointer; background-color: rgb(255, 255, 255); box-shadow: none; outline: none !important;\"><span style=\"font-weight: bolder;\">&nbsp;Fire Safety Plan&nbsp;</span></a><br></p>', '1-Sam Dev', 1, '2023-08-14 10:33:54', '2023-12-13 06:36:38'),
(6, 'Others Design Consultancy Support', 'others-design-consultancy-support', 'Others Design Consultancy Support in Bangladesh', 'design-and-consultancy-services', 'others-design-consultancy-support-design-and-consultancy-services-2023-08-14-16-35-15-134567.jpg', 'We offer additionally Electrical & Fire Safety Design /Audit, Fire Hydrant & Sprinkler Systems Design, Fire Alarm Systems Design, SLD Design & LPS Design.', '<p><span style=\"color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">As a design team.</span></p><p><span style=\"color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">We offer additionally&nbsp;</span><a href=\"https://technoapogee.com/fire-detection-alarm-systems-design/\" target=\"_blank\" rel=\"noopener\" style=\"color: rgb(37, 37, 37); transition: all 0.3s ease 0s; cursor: pointer; background-color: rgb(255, 255, 255); box-shadow: none; font-family: Roboto, sans-serif; outline: none !important;\"><span style=\"font-weight: bolder;\">Electrical &amp; Fire Safety Design</span>&nbsp;</a><span style=\"color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">/Audit,&nbsp;</span><a href=\"https://technoapogee.com/fire-hydrant-and-sprinkler-systems-design/\" target=\"_blank\" style=\"color: rgb(37, 37, 37); transition: all 0.3s ease 0s; cursor: pointer; background-color: rgb(255, 255, 255); box-shadow: none; font-family: Roboto, sans-serif; outline: none !important;\"><span style=\"font-weight: bolder;\">Fire Hydrant &amp; Sprinkler Systems Design</span></a><span style=\"color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">, Fire Alarm Systems Design,&nbsp;</span><a href=\"https://technoapogee.com/lightning-protection-system-lps-design/\" target=\"_blank\" style=\"color: rgb(37, 37, 37); transition: all 0.3s ease 0s; cursor: pointer; background-color: rgb(255, 255, 255); box-shadow: none; font-family: Roboto, sans-serif; outline: none !important;\"><span style=\"font-weight: bolder;\">SLD Design &amp; LPS Design</span></a>.</p><p><span style=\"color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">&nbsp;Due to our extensive know-how of Development works as turnkey Projects in several Giant Industry for Electrical &amp; Fire Safety Design , Risk Assessment, and Implementation as per BNBC &amp; NFPA</span><br></p>', '1-Sam Dev', 1, '2023-08-14 10:35:15', '2023-12-13 06:36:18'),
(10, 'ELECTRICAL SOLUTION', 'electrical-solution', NULL, 'hvac-and-bbt', 'electrical-solution-electrical-solution-2023-08-16-18-09-06-206886.jpg', 'Techno Apogee is a leading Creator, Developer, and Integrator of energy efficiency and infrastructure renewal solutions in support of economic and environmental sustainability', '<p>Techno Apogee is a leading Creator, Developer, and Integrator of energy efficiency and infrastructure renewal solutions in support of economic and environmental sustainability&nbsp;</p>', '12-Admin', 0, '2023-08-16 12:09:06', '2023-09-03 07:12:48'),
(12, 'HVAC System', 'hvac-system', 'hvac System in bangladesh', 'hvac-and-bbt', 'hvac-system-electrical-solution-2023-09-03-12-04-22-900648.jpg', 'HVAC, Heating, Ventilation, and Air Conditioning, system,component, building, hvac, techno apogee, techno, apogee, apogee limited,', '<p style=\"box-sizing: inherit; border-style: initial; border-color: initial; border-image: initial; margin-bottom: 1.6em; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(100, 86, 89); font-family: &quot;Open Sans&quot;, sans-serif;\"><span style=\"background-color: rgb(255, 255, 255);\">Our&nbsp;<span style=\"box-sizing: inherit; font-weight: 700;\">HVAC system</span>&nbsp;is designed to meet the specific needs of buildings in Bangladesh, with features that are optimized for the local climate and conditions. Our system is highly efficient and reliable, using state-of-the-art technology to ensure that your building remains comfortable and well-ventilated at all times.</span></p><p style=\"box-sizing: inherit; border-style: initial; border-color: initial; border-image: initial; margin-bottom: 1.6em; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(100, 86, 89); font-family: &quot;Open Sans&quot;, sans-serif;\"><span style=\"box-sizing: inherit; font-weight: 700; background-color: rgb(255, 255, 255);\">Here are some key features of our HVAC system:</span></p><ol style=\"border-style: initial; border-color: initial; border-image: initial; margin-bottom: 1.5em; margin-left: 3em; outline: 0px; padding-left: 0px; vertical-align: baseline; list-style-type: decimal; color: rgb(100, 86, 89); font-family: &quot;Open Sans&quot;, sans-serif;\"><li style=\"box-sizing: inherit; border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\"><p style=\"box-sizing: inherit; border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-weight: inherit; margin-bottom: 1.6em; outline: 0px; padding: 0px; vertical-align: baseline;\"><span style=\"background-color: rgb(255, 255, 255);\">Energy Efficiency: Our HVAC system is designed to be highly energy efficient, reducing energy costs and reducing your building‚Äôs carbon footprint. The system uses advanced technologies, such as variable speed fans and variable refrigerant flow systems, to minimize energy consumption.</span></p></li><li style=\"box-sizing: inherit; border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\"><p style=\"box-sizing: inherit; border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-weight: inherit; margin-bottom: 1.6em; outline: 0px; padding: 0px; vertical-align: baseline;\"><span style=\"background-color: rgb(255, 255, 255);\">Indoor Air Quality: Our HVAC system is designed to improve indoor air quality by filtering and purifying the air to remove pollutants and allergens. The system includes a high-efficiency air filter and a UV light system to kill bacteria and viruses, ensuring that the air in your building is always clean and healthy.</span></p></li><li style=\"box-sizing: inherit; border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\"><p style=\"box-sizing: inherit; border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-weight: inherit; margin-bottom: 1.6em; outline: 0px; padding: 0px; vertical-align: baseline;\"><span style=\"background-color: rgb(255, 255, 255);\">Temperature Control: Our HVAC system allows you to precisely control the temperature in your building, ensuring that it remains comfortable and inviting at all times. The system includes a programmable thermostat that allows you to set the desired temperature and automatically adjust it as needed.</span></p></li><li style=\"box-sizing: inherit; border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\"><p style=\"box-sizing: inherit; border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-weight: inherit; margin-bottom: 1.6em; outline: 0px; padding: 0px; vertical-align: baseline;\"><span style=\"background-color: rgb(255, 255, 255);\">Humidity Control: Our HVAC system is designed to regulate the humidity in your building, reducing the risk of mold and mildew and improving overall comfort. The system uses advanced dehumidification technology to ensure that the humidity level is always within a healthy and comfortable range.</span></p></li><li style=\"box-sizing: inherit; border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\"><p style=\"box-sizing: inherit; border-style: initial; border-color: initial; border-image: initial; font-style: inherit; font-weight: inherit; margin-bottom: 1.6em; outline: 0px; padding: 0px; vertical-align: baseline;\"><span style=\"background-color: rgb(255, 255, 255);\">Easy Maintenance: Our HVAC system is designed to be easy to maintain, with minimal downtime and simple, straightforward maintenance procedures. The system includes features that make it easy to access and clean the filters and other components, ensuring that your building remains comfortable and well-ventilated at all times.</span></p></li></ol><p style=\"box-sizing: inherit; border-style: initial; border-color: initial; border-image: initial; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(100, 86, 89); font-family: &quot;Open Sans&quot;, sans-serif;\"><span style=\"background-color: rgb(255, 255, 255);\">At <b>Techno Apogee</b>, we are dedicated to providing high-quality HVAC systems for buildings in Bangladesh. Our system is designed to be reliable, efficient, and easy to maintain, ensuring that your building remains comfortable and well-ventilated at all times. Whether you are looking to upgrade your existing HVAC system or install a new system in a new building, we have the expertise and experience to provide the perfect solution for your needs. Contact us today to learn more about our&nbsp;<span style=\"box-sizing: inherit; font-weight: 700;\">HVAC system</span>&nbsp;and how we can help keep your building comfortable and well-ventilated.</span></p>', '1-Sam Dev', 0, '2023-09-03 06:04:23', '2024-10-22 10:55:56'),
(13, 'BBT Solution', 'busbar-trunking-bbt-systems', 'busbar trunking system in Bangladesh', 'hvac-and-bbt', 'busbar-trunking-bbt-systems-electrical-solution-2023-08-16-17-43-01-413641.jpg', 'engineering, transformer, construction, power, bbt, banks, hospitals, trade', '<div class=\"col-12  sm-margin-30px-bottom\" style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; width: 760.5px; color: rgb(111, 111, 111); font-family: Roboto, sans-serif; font-size: 14px;\"><h6 class=\"c-font font-weight-700 text-extra-dark-gray margin-10px-bottom c-font\" style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; margin-bottom: 10px; font-weight: 700; line-height: 30px; font-size: 25px; padding: 0px; letter-spacing: 0px; color: rgb(35, 35, 35); font-family: Roboto, sans-serif;\">SANDWICH TYPE BBT (EX)</h6></div><div class=\"col-12  sm-margin-30px-bottom\" style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; width: 760.5px; color: rgb(111, 111, 111); font-family: Roboto, sans-serif; font-size: 14px;\"><p class=\"c-font text-dark-gray\" style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; margin-bottom: 25px; color: rgb(98, 98, 98);\"></p><p style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; margin-bottom: 25px;\"><span style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; color: rgb(98, 98, 98);\">The compact system EX line is used for the distribution of power in large industries, for riser end feed units, and for commercial and service sector buildings (banks, hospitals, trade, and business centers, etc.). The ultra-compact dimensions of the EX enhance the short-circuit stress resistance features, reduce the impedance of the circuit by limiting voltage drops and enables the installation of high power electrical systems even in extremely cramped spaces. Any section can be taken out without moving the adjacent ones. At any moment it is possible to modify the path of the run, which makes EX a very flexible system. Energypac EX can be installed quickly. It is easy to manage and suitable for modifications and extensions, which is always necessary for installations where EX is used. EX has a wide range of tap-off boxes rated from 25A to 1250A, thus allowing the supply and protection of all kinds of loads due to the availability of different protection devices such as fuses, moulded case circuit breakers, and motorized switches.</span></p><p style=\"text-align: right; transition-timing-function: ease-in-out; transition-duration: 0.2s; margin-bottom: 25px;\"><span style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; color: rgb(98, 98, 98);\"></span></p><ul class=\"p-0 list-style-5 margin-10px-bottom text-dark-gray\" style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; margin-bottom: 0px; color: rgb(98, 98, 98);\"><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-width: 1px; border-bottom-color: rgba(0, 0, 0, 0.1);\">Complies with international and domestic standards.</li><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-width: 1px; border-bottom-color: rgba(0, 0, 0, 0.1);\">Complies with IEC61439-1 e IEC61439-6.</li><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-width: 1px; border-bottom-color: rgba(0, 0, 0, 0.1);\">4 Conductor (3P+N).</li><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-width: 1px; border-bottom-color: rgba(0, 0, 0, 0.1);\">5 Conductor (3P+N+PE)</li><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-style: initial; border-bottom-color: initial;\">conductor type aluminum and copper</li></ul><p style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-style: initial; border-bottom-color: initial;\"><br></p><div class=\"col-12  sm-margin-30px-bottom\" style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; width: 760.5px;\"><h6 class=\"c-font font-weight-700 text-extra-dark-gray margin-10px-bottom c-font\" style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; margin-bottom: 10px; font-weight: 700; line-height: 30px; font-size: 25px; padding: 0px; letter-spacing: 0px; color: rgb(35, 35, 35); font-family: Roboto, sans-serif;\">AIR INSULATED TYPE BBT (AX)</h6></div><div class=\"col-12  sm-margin-30px-bottom\" style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; width: 760.5px;\"><p class=\"c-font text-dark-gray\" style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; margin-bottom: 25px; color: rgb(98, 98, 98);\"></p><p style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; margin-bottom: 25px;\"><span style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; color: rgb(98, 98, 98);\">AX (Medium Rating ‚Äì Air Insulated) is part of the Energypac range used for the distribution of power in medium-large installations; it is also particularly suitable in rising main applications (trunking systems) within buildings used for the service sector. Very compact size, high short circuit strength, low voltage drop, and good corrosion strength make the AX system suitable for installation in small spaces and difficult environments. Any section can be taken out without moving the adjacent ones. At any moment it is possible to modify the path of the run, which makes AX a very flexible system. Energypac AX can be installed quickly also thanks to the single-bolt joint. It is easy to manage and suitable for modifications and extensions, which is always necessary for installations where AX is used. AX has a wide range of tap-off boxes which are rated from 16A to 160A, thus allowing the supply and protection of all kinds of loads using different protection devices such as miniature circuit breakers and/or molded case circuit breakers.</span></p><p style=\"text-align: right; transition-timing-function: ease-in-out; transition-duration: 0.2s; margin-bottom: 25px;\"><span style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; color: rgb(98, 98, 98);\"></span></p><ul class=\"p-0 list-style-5 margin-10px-bottom text-dark-gray\" style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; margin-bottom: 0px; color: rgb(98, 98, 98);\"><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-width: 1px; border-bottom-color: rgba(0, 0, 0, 0.1);\">Complies with international and domestic standards.</li><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-width: 1px; border-bottom-color: rgba(0, 0, 0, 0.1);\">Complies with IEC61439-1 e IEC61439-6</li><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-width: 1px; border-bottom-color: rgba(0, 0, 0, 0.1);\">4 Conductor (3P+N)</li><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-width: 1px; border-bottom-color: rgba(0, 0, 0, 0.1);\">5 Conductor (3P+N+PE)</li><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-width: 1px; border-bottom-color: rgba(0, 0, 0, 0.1);\">160A to 800A for Aluminum conductors</li><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-style: initial; border-bottom-color: initial;\">250A to 1000A for Copper Conductors</li></ul><p style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-style: initial; border-bottom-color: initial;\"><br></p><div class=\"col-12  sm-margin-30px-bottom\" style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; width: 760.5px;\"><h6 class=\"c-font font-weight-700 text-extra-dark-gray margin-10px-bottom c-font\" style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; margin-bottom: 10px; font-weight: 700; line-height: 30px; font-size: 25px; padding: 0px; letter-spacing: 0px; color: rgb(35, 35, 35); font-family: Roboto, sans-serif;\">LIGHTING TYPE BBT (LX)</h6></div><div class=\"col-12  sm-margin-30px-bottom\" style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; width: 760.5px;\"><p class=\"c-font text-dark-gray\" style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; margin-bottom: 25px; color: rgb(98, 98, 98);\"></p><p style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; margin-bottom: 25px;\"><span style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; color: rgb(98, 98, 98);\">LX (Low Power ‚Äì Lighting Busbar) supplied by Energypac is the ideal solution for supplying power to light fittings within the service sector and in most manufacturing industries and wherever it is necessary to hang very heavy accessories. It also can be used for supplying power to three-phase and single-phase devices: industrial refrigerators, lathes, handheld tools, etc.</span></p><p style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; margin-bottom: 25px;\"><span style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; color: rgb(98, 98, 98);\"></span></p><ul class=\"p-0 list-style-5 margin-10px-bottom text-dark-gray\" style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; margin-bottom: 0px; color: rgb(98, 98, 98);\"><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-width: 1px; border-bottom-color: rgba(0, 0, 0, 0.1);\">Speed, simplicity, and flexibility when planning and installing the lines</li><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-width: 1px; border-bottom-color: rgba(0, 0, 0, 0.1);\">Capable of being installed both in false ceilings and below floating floors</li><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-width: 1px; border-bottom-color: rgba(0, 0, 0, 0.1);\">Complies with international and domestic standards.</li><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-width: 1px; border-bottom-color: rgba(0, 0, 0, 0.1);\">Complies with IEC61439-1, IEC61439-6</li><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-width: 1px; border-bottom-color: rgba(0, 0, 0, 0.1);\">Number of Conductor 2 and 4</li><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-width: 1px; border-bottom-color: rgba(0, 0, 0, 0.1);\">Product Range 25A 40A 63A</li><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-width: 1px; border-bottom-color: rgba(0, 0, 0, 0.1);\">Degree of protection: IP 55</li><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-width: 1px; border-bottom-color: rgba(0, 0, 0, 0.1);\">Dimensions: 17x47 mm</li><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-width: 1px; border-bottom-color: rgba(0, 0, 0, 0.1);\">Conductor type: Copper (99.9% pure)</li><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-width: 1px; border-bottom-color: rgba(0, 0, 0, 0.1);\">Casing: Painted or with an anodized Aluminum casing.</li><li style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; position: relative; padding: 0px 0px 10px 22px; margin: 0px 0px 10px; border-bottom-style: initial; border-bottom-color: initial;\">Thickness: 0.9mm</li></ul><p style=\"text-align: right; transition-timing-function: ease-in-out; transition-duration: 0.2s; margin-bottom: 25px;\"><span style=\"transition-timing-function: ease-in-out; transition-duration: 0.2s; color: rgb(98, 98, 98);\"><br></span></p></div></div></div>', '1-Sam Dev', 0, '2023-08-16 11:43:01', '2024-01-23 05:54:19'),
(14, 'Solar Power Systems', 'solar-power-systems', 'Solar Power Systems in Bangladesh', 'hvac-and-bbt', 'solar-power-systems-hvac-and-bbt-2023-10-15-14-55-15-469252.PNG', 'The term ‚ÄúSolar Power System‚Äù includes a technology that runs on energy extracted  from sunlight. This is typically self-contained and universally renewable. This can also  be as small as a solar-powered night torch and grow to massive proportions like a  Solar-Panelled Roof that covers the entire property. There are two types of Solar Power Systems available in the market: 1. Off-grid solar power system: This system does not connect to any other source  of conventional electric line. They are more suitable for rural areas with poor or  no grid connectivity. 2. Grid-tied solar power systems: For areas with adequate grid connectivity,  property owners are more likely to stay connected to the grid, as they use their  solar power system as an alternate source of energy. With this, someone can  use solar-powered energy when the sun is shining, and conventional electricity  offered by utility companies at other times. You can also scale your solar power  system over time based on your finances.', '<p>The term ‚ÄúSolar Power System‚Äù includes a technology that runs on energy extracted \r\nfrom sunlight. This is typically self-contained and universally renewable. This can also \r\nbe as small as a solar-powered night torch and grow to massive proportions like a \r\nSolar-Panelled Roof that covers the entire property.\r\n</p><p>There are two types of Solar Power Systems available in the market:\r\n</p><ol><li>&nbsp;Off-grid solar power system: This system does not connect to any other source \r\nof conventional electric line. They are more suitable for rural areas with poor or \r\nno grid connectivity.\r\n</li><li>&nbsp;Grid-tied solar power systems: For areas with adequate grid connectivity, \r\nproperty owners are more likely to stay connected to the grid, as they use their \r\nsolar power system as an alternate source of energy. With this, someone can \r\nuse solar-powered energy when the sun is shining, and conventional electricity \r\noffered by utility companies at other times. You can also scale your solar power \r\nsystem over time based on your finances.</li></ol><p>Benefits of Solar Power System:</p><ol><li>Solar Power is pollution-free and does not emit greenhouse gases.</li><li>It reduces dependence on foreign oil and fossil fuels.</li><li>Solar power is a renewable source of energy that can be gathered \r\npractically anywhere in the world. </li><li>Solar power provides green jobs and is economical in the long run.</li><li>The source of solar energy, the sun, is nearly limitless and can be accessed \r\nanywhere on earth at one time or another.&nbsp;<br></li></ol>', '1-Sam Dev', 1, '2023-10-15 08:55:16', '2023-12-13 06:34:28'),
(17, 'Fire Detection System', 'fire-detection-system', 'Fire Detection System in Bangladesh', 'fire-solution', 'fire-detection-system-fire-solution-2023-08-16-17-49-06-320428.jpg', 'When combined with other elements of an emergency response and evacuation plan, Automatic Fire Detection Systems can significantly reduce Property Damage, Personal injuries, and loss of life from fire in the workplace. Their main function is to quickly identify a developing fire and alert occupants and emergency response personnel before extensive damage occurs. Automatic Fire Detector may also directly connect to an alarm monitoring center and control panel to the networking interface with BMS. Benefits of Fire Detection & Alarm Systems:  An early warning benefit, low cost, and opportunity to place the device in chosen locations. Smoke /heat detectors are best in areas where early detection and warning of fire are critical to preserving life. The fire pump, elevator, sprinkler, flow & tamper switch can be connected to the fire alarm to save lives.', '<p>When combined with other elements of an emergency response and evacuation plan, \r\nAutomatic Fire Detection Systems can significantly reduce Property Damage, Personal \r\ninjuries, and loss of life from fire in the workplace. Their main function is to quickly \r\nidentify a developing fire and alert occupants and emergency response personnel \r\nbefore extensive damage occurs. Automatic Fire Detector may also directly connect \r\nto an alarm monitoring center and control panel to the networking interface with BMS.</p><p><br></p><p><br></p><p>Benefits of Fire Detection &amp; Alarm Systems:</p><ol><li>An early warning benefit, low cost, and opportunity to place the device in \r\nchosen locations.</li><li>Smoke /heat detectors are best in areas where early detection and warning of \r\nfire are critical to preserving life.</li><li>The fire pump, elevator, sprinkler, flow &amp; tamper switch can be connected to \r\nthe fire alarm to save lives.<br></li></ol>', '1-Sam Dev', 1, '2023-08-16 11:49:06', '2023-12-13 06:33:53'),
(18, 'Fire Protection Systems', 'fire-protection-systems', 'Fire Protection Systems in Bangladesh', 'fire-solution', 'fire-protection-systems-fire-solution-2023-08-16-17-49-57-583148.jpg', 'Fire Protection System (FPS) is a system that directly suppresses or controls fire, when occurs in a building and tends to spreads out. Usually, it consists of a fire hydrant, hose reel, and other water-based fixed firefighting systems (FFFS), such as sprinkler systems, water mist systems, etc. The fire incident in the generator room, sub-station, server room or data center, kitchen area are extinguished by special gases such as Carbon-di-oxide, FM 200 or Novec 1230 are also a part of the Fire Protection System.', '<p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\"><span style=\"font-weight: bolder;\">Fire</span>&nbsp;Protection S<span style=\"font-weight: bolder;\">ystem</span>&nbsp;(FPS) is a system that directly suppresses or controls fire, when occurs in a building and tends to spreads out. Usually, it consists&nbsp;<span style=\"font-weight: bolder;\">of a&nbsp;</span><span style=\"font-weight: bolder;\">fire</span><span style=\"font-weight: bolder;\">&nbsp;</span><span style=\"font-weight: bolder;\">hydrant</span>, hose reel, and other water-based fixed&nbsp;<span style=\"font-weight: bolder;\">firefighting</span>&nbsp;<span style=\"font-weight: bolder;\">systems</span>&nbsp;(FFFS), such as&nbsp;<span style=\"font-weight: bolder;\">sprinkler</span>&nbsp;<span style=\"font-weight: bolder;\">systems</span>, water mist systems, etc. The fire incident in the generator room, sub-station, server room or data center, kitchen area are extinguished by special gases such as Carbon-di-oxide, FM 200 or Novec 1230 are also a part of the Fire Protection System.</p><p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">Its purpose is to enhance life safety and lower the possible property damage by fire.</p><p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">&nbsp;</p><p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\"><span style=\"font-weight: bolder;\">FPS can be classified into a few types:</span></p><ol style=\"padding-left: 1.59rem; margin-bottom: 25px; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\"><li style=\"margin-bottom: 0px; line-height: 2.2;\"><a href=\"https://technoapogee.com/fire-hydrant-systems/\" style=\"color: rgb(37, 37, 37); transition: all 0.3s ease 0s; cursor: pointer; box-shadow: none; outline: none !important;\"><span style=\"font-weight: bolder;\">Fire Hydrant Systems</span></a><span style=\"font-weight: bolder;\">:&nbsp;</span>It consists of a Fire Pump, Hose Reels, a Pillar Hydrant Etc. The Fire pump supplies water in a certain pressure and adequate flow rate to extinguish the fire by Hose Pipe, Pillar Hydrants, Etc</li><li style=\"margin-bottom: 0px; line-height: 2.2;\"><a href=\"https://technoapogee.com/fire-sprinkler-systems/\" style=\"color: rgb(37, 37, 37); transition: all 0.3s ease 0s; cursor: pointer; box-shadow: none; outline: none !important;\"><span style=\"font-weight: bolder;\">Fire Sprinkler Systems</span></a><span style=\"font-weight: bolder;\">:&nbsp;</span>A&nbsp;<span style=\"font-weight: bolder;\">fire sprinkler system is</span>&nbsp;an&nbsp;<a href=\"https://en.wikipedia.org/wiki/Active_fire_protection\" style=\"color: rgb(37, 37, 37); transition: all 0.3s ease 0s; cursor: pointer; box-shadow: none; outline: none !important;\">active fire protection</a>&nbsp;method, consisting of a water supply system, providing adequate pressure and flowrate to a water distribution piping system, onto which&nbsp;<a href=\"https://en.wikipedia.org/wiki/Fire_sprinkler\" style=\"color: rgb(37, 37, 37); transition: all 0.3s ease 0s; cursor: pointer; box-shadow: none; outline: none !important;\">fire sprinklers</a>&nbsp;are connected.&nbsp;These Sprinklers are also connected with Hydrant System.</li></ol><ol start=\"2\" style=\"padding-left: 1.59rem; margin-bottom: 25px; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\"><li style=\"margin-bottom: 0px; line-height: 2.2;\"><span style=\"font-weight: bolder;\">Fire&nbsp;</span><a href=\"https://technoapogee.com/fire-suppression-systems/\" style=\"color: rgb(37, 37, 37); transition: all 0.3s ease 0s; cursor: pointer; box-shadow: none; outline: none !important;\"><span style=\"font-weight: bolder;\">Suppression Systems</span></a><span style=\"font-weight: bolder;\">: A fire</span><span style=\"font-weight: bolder;\">&nbsp;suppression system</span>&nbsp;is a term to describe the use of inert gases and chemical agents to extinguish a fire. It‚Äôs also called Clean Agent Fire Suppression.&nbsp;The system typically consists of the agent, agent storage containers, agent release valves, fire detectors, fire detection system (wiring control panel, actuation signaling), agent delivery piping, and agent dispersion nozzles.&nbsp;&nbsp;The fire gets extinguished, within a minute of activation and everything is automatic. Gas Suppression Systems are generally used in concealed rooms. The principle used by Gas Suppression System is by breaking the Fire Triangle, the fire ceases to exist. In the room, protected by Gas Suppression System, there are various detectors placed at various locations. Each detector constantly monitors the room for signs of fire.</li></ol><p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">As soon as the fire is detected, an alarm is sounded, to the personnel to evacuate the entire room. Then, a gas-like, Novec, Clean Agent or Co2 is released in the enclosed room. Thus, the oxygen in the room is rapidly reduced, to a level where fire cannot exist.</p>', '1-Sam Dev', 1, '2023-08-16 11:49:57', '2023-12-13 06:33:35'),
(19, 'Fire Suppression Systems', 'fire-suppression-systems', 'Fire Suppression Systems in Bangladesh', 'fire-solution', 'fire-suppression-systems-fire-solution-2023-10-15-14-19-49-246920.jpg', 'Fire suppression systems always consist of at least  one component designed to extinguish a fire by  applying an external substance. Many fire  suppression systems also consist of fire detection  systems and signaling mechanisms designed to  alert workers to the problem and prompt  responsible persons to take further suppressive  actions. The detection of fire often automatically  activates the extinguishing component of the  system; however, some fire suppression systems  require manual activation.', '<p>Fire suppression systems always consist of at least \r\none component designed to extinguish a fire by \r\napplying an external substance. Many fire \r\nsuppression systems also consist of fire detection \r\nsystems and signaling mechanisms designed to \r\nalert workers to the problem and prompt \r\nresponsible persons to take further suppressive \r\nactions. The detection of fire often automatically \r\nactivates the extinguishing component of the \r\nsystem; however, some fire suppression systems \r\nrequire manual activation.</p><p>Benefits Fire Suppression Systems</p><ol><li>The benefits of all types of clean suppression \r\nsystems are that they are environment-friendly \r\nand don‚Äôt deplete the ozone.</li><li>Safe to use where people are present, a \r\nsuppression system can be installed in both \r\noccupied and unoccupied rooms.</li><li>It will diffuse the fire quickly (10 seconds) and \r\nalso minimize the amount of soot and smoke \r\nthat fills a room during a fire.<br></li></ol>', '1-Sam Dev', 1, '2023-10-15 08:19:49', '2023-12-13 06:33:14');
INSERT INTO `product_services` (`id`, `__prosername`, `__proserslug`, `__prosertitle`, `__prosermenuselect`, `__proserheadimage`, `__proserkeyword`, `__proserdescription`, `added_by`, `is_active`, `created_at`, `updated_at`) VALUES
(20, 'Aspiration Smoke Detection', 'aspiration-smoke-detection', 'Aspiration Smoke Detection in Bangladesh', 'fire-solution', 'aspiration-smoke-detection-fire-solution-2023-10-15-14-36-49-767075.PNG', 'The installation, testing, and commissioning  of aspirating smoke detection (ASD) systems  are governed by several codes and  standards. We follow codes and standards  that must be referenced while designing ASD  systems as National Fire Alarm and Signaling  Code (NFPA 72,75,76).', '<p>The installation, testing, and commissioning \r\nof aspirating smoke detection (ASD) systems \r\nare governed by several codes and \r\nstandards. We follow codes and standards \r\nthat must be referenced while designing ASD \r\nsystems as National Fire Alarm and Signaling \r\nCode (NFPA 72,75,76).</p><p>Benefits of Aspiration Systems</p><ol><li>Earliest warning detection with the highest level \r\nof false alarm immunity&nbsp;</li><li>Reduced installation and maintenance costs</li><li>Extended device lifetime using advanced filtration \r\ntechniques</li><li>Remote monitoring capabilities and richer \r\nreporting via TCP/IP connectivity<br></li></ol>', '1-Sam Dev', 1, '2023-10-15 08:36:50', '2024-01-24 06:37:56'),
(21, 'Expansion Joint', 'expansion-joint', 'Expansion Joint in Bangladesh', 'fire-solution', 'expansion-joint-fire-solution-2023-08-16-17-56-56-371907.jpeg', 'A concrete Expansion Joint or Control Joint is a gap  that allows the concrete to expand and contract  as/when the temperature change. It forms a break  between the concrete and other parts of a structure  to allow movement without causing stress, which can  lead to cracking. Provides safety of the building from cracks or breakage due to temperature change or in the event of an earthquake. Stop the fire propagation if the sealant used in the expansion joint is fireproof.', '<h5><font color=\"#424242\" style=\"\">About Expansion Joint solution</font></h5><p>A concrete Expansion Joint or Control Joint is a gap \r\nthat allows the concrete to expand and contract \r\nas/when the temperature changes. It forms a break \r\nbetween the concrete and other parts of a structure \r\nto allow movement without causing stress, which can \r\nlead to cracking.</p><h5><font color=\"#424242\" style=\"\">Benefits of Expansion Joint:</font></h5><ol><li><font color=\"#424242\" style=\"\">Provides safety of the building from cracks \r\nor breakage due to temperature change or \r\nin the event of an earthquake.</font></li><li><font color=\"#424242\" style=\"\">Stop the fire propagation if the sealant used \r\nin the expansion joint is fireproof.</font></li></ol>', '1-Sam Dev', 0, '2023-08-16 11:56:56', '2024-01-24 06:39:41'),
(22, 'Cable Penetration', 'cable-penetration', 'Cable Penetration in Bangladesh', 'fire-solution', 'cable-penetration-fire-solution-2023-08-16-17-54-47-174170.jpg', 'Some Fire Proof sealing materials are used in Cable and  Pipe Penetrations of sensitive locations to avoid the risk  of Fire. For example, Fire Rated Collars, Wrap Strips,  Angle, Gasket, Sleeve Joints, etc., are used as Cable  and Pipe Penetration Seals which resist the passage of  smoke and Fire by expanding and collapsing  combustible Cable or Pipes, forming a dense char.', '<p>Some Fireproof sealing materials are used in Cable and \r\nPipe Penetrations of sensitive locations to avoid the risk \r\nof Fire. For example, Fire Rated Collars, Wrap Strips, \r\nAngle, Gasket, Sleeve Joints, etc., are used as Cable \r\nand Pipe Penetration Seals that resist the passage of \r\nsmoke and Fire by expanding and collapsing \r\ncombustible Cable or Pipes, forming a dense char.&nbsp;</p><p>Benefits of Cable Penetration</p><ol><li>Ensure Life Safety and Property Safety as \r\npassive Fire Protection Devices.</li><li>They can be used in Data Centers, \r\nServer Rooms, Marine Ships, etc., to \r\nprotect those places from Fire Risks.<br></li></ol>', '1-Sam Dev', 0, '2023-08-16 11:54:47', '2024-01-24 06:39:30'),
(23, 'Lightning Protection System', 'lightning-protection-system', 'Lighting Protection System in Bangladesh', 'fire-solution', 'lightning-protection-system-fire-solution-2023-08-16-17-52-04-087765.jpg', 'A lightning protection system (LPS) is essential to any building. This part contains information about the risk of lightning strikes, lightning characteristics, and the resulting parameters for simulating the effects of lightning strikes. We design & work for risk management of LPS following IEC 62305-2 (EN 62305-2)/NFPA 780/BNBC for risk analysis to determine whether lightning protection is required. This method can be used to simply determine the class of LPS and establish a complex protection system against lightning electromagnetic impulses (LEMP) following IEC 62305-2 (EN 62305-2)/NFPA 780/BNBC.', '<p>A lightning protection system (LPS) is essential to any building. \r\nThis part contains information about the risk of lightning strikes, \r\nlightning characteristics, and the resulting parameters for \r\nsimulating the effects of lightning strikes. We design &amp; work for \r\nrisk management of LPS following IEC 62305-2 (EN \r\n62305-2)/NFPA 780/BNBC for risk analysis to determine \r\nwhether lightning protection is required. This method can be \r\nused to simply determine the class of LPS and establish a \r\ncomplex protection system against lightning electromagnetic \r\nimpulses (LEMP) following IEC 62305-2 (EN 62305-2)/NFPA \r\n780/BNBC.</p><p>Benefits of Lightning\r\nProtection Systems</p><ol><li>Reduction of electromagnetic \r\nradiating effects within the \r\nprotected structure.</li><li>Spreading of lightning currents \r\nover several down conductors.</li><li>Economic Contributes to overall \r\nequipotential between the \r\nconducting structures and ground.<br></li></ol>', '1-Sam Dev', 1, '2023-08-16 11:52:04', '2023-12-13 06:31:50'),
(24, 'Fire Door', 'fire-door', 'Fire Doors In Bangladesh', 'fire-solution', 'fire-door-fire-solution-2023-10-15-15-00-23-965704.PNG', 'A fire door is a door with a fire-resistance  rating (sometimes referred to as a fire  protection rating for closures) used as part  of a passive fire protection system to reduce  the spread of fire and smoke between  separate compartments of a structure and  to enable safe egress from a building or  structure.', '<p>A fire door is a door with a fire-resistance \r\nrating (sometimes referred to as a fire \r\nprotection rating for closures) used as part \r\nof a passive fire protection system to reduce \r\nthe spread of fire and smoke between \r\nseparate compartments of a structure and \r\nto enable safe egress from a building or \r\nstructure.</p><p>Benefits of Fire Door</p><ol><li>Fire-rated doors help facilitate the safe and quick \r\nevacuation of occupants.</li><li>Fire-rated doors help minimize damage to the \r\nproperty.</li><li>The fire escape door is built with such care that \r\nthere is hardly any chance of breaching the security \r\nof these doors.<br></li></ol>', '1-Sam Dev', 1, '2023-10-15 09:00:24', '2023-12-13 06:31:13'),
(32, 'Automation Solution', 'automation-solution', NULL, 'automation-solution', 'automation-solutation-automation-solution-2023-08-16-18-00-11-469865.jpg', 'Techno Apogee is founded by a group of engineers and consultants.  Who have experience in Architectural, Electrical, Electro-Mechanical, and Communication (IT) design, drawing, project supervision at the national level by the Following BNBC, NFPA, VDE, BS, IEC code.  As an Enlisted Consultants of FSCD (Bangladesh Fire Service & Civil defense ), we provide consultancy, design, and accredited checking services with expertise and contributed to the development in NOC & Fire Safety Plan in Industrial, Commercial, Residential  Sector by NOC (Non-Objection Certificate ) & Fire Safety Plan', '<div class=\"container\">\r\n        <div class=\"row g-3\">\r\n            \r\n            \r\n            <div class=\"col-12 col-md-6 col-lg-4\">\r\n                <div class=\"mt-3\"></div>\r\n                <div class=\"card\">\r\n                    <a href=\"https://technoapogee.com/en/product-and-service/home-hotel-automation\">\r\n                        <img src=\"https://technoapogee.com/public/image/productservice/home-hotel-automation-automation-solution-2023-08-16-18-00-51-661505.png\" alt=\"\">\r\n                    </a>\r\n                    <div class=\"card-body\">\r\n                        <h5 class=\"card-title\">\r\n                            <a href=\"https://technoapogee.com/en/product-and-service/home-hotel-automation\" style=\"color: #000;\">Home Hotel Automation</a>\r\n                        </h5>\r\n                        \r\n                    </div>\r\n                </div>\r\n            </div>\r\n           \r\n             \r\n            <div class=\"col-12 col-md-6 col-lg-4\">\r\n                <div class=\"mt-3\"></div>\r\n                <div class=\"card\">\r\n                    <a href=\"https://technoapogee.com/en/product-and-service/security-automation\">\r\n                        <img src=\"https://technoapogee.com/public/image/productservice/security-automation-automation-solution-2023-08-16-18-01-34-642472.jpg\" alt=\"\">\r\n                    </a>\r\n                    <div class=\"card-body\">\r\n                        <h5 class=\"card-title\">\r\n                            <a href=\"https://technoapogee.com/en/product-and-service/security-automation\" style=\"color: #000;\">Security Automation</a>\r\n                        </h5>\r\n                        \r\n                    </div>\r\n                </div>\r\n            </div>\r\n           \r\n \r\n            <div class=\"col-12 col-md-6 col-lg-4\">\r\n                <div class=\"mt-3\"></div>\r\n                <div class=\"card\">\r\n                    <a href=\"https://technoapogee.com/en/product-and-service/bms-ems\">\r\n                        <img src=\"https://technoapogee.com/public/image/productservice/bms-ems-automation-solution-2023-08-16-18-02-32-573466.png\" alt=\"\">\r\n                    </a>\r\n                    <div class=\"card-body\">\r\n                        <h5 class=\"card-title\">\r\n                            <a href=\"https://technoapogee.com/en/product-and-service/bms-ems\" style=\"color: #000;\">Bms Ems</a>\r\n                        </h5>\r\n                        \r\n                    </div>\r\n                </div>\r\n            </div>\r\n           \r\n        </div>\r\n    </div>', '12-Techno Apogee', 0, '2023-08-16 12:00:11', '2023-09-03 07:12:28'),
(33, 'Home Hotel Automation', 'home-hotel-automation', NULL, 'automation-solution', 'home-hotel-automation-automation-solution-2023-08-16-18-00-51-661505.png', 'home automation equipment, home, automation, equipment, home WiFi control, home automation systems,home automation us,home, automation, systems,home automation, equipment home, WiFi, control, home automation systems, smart home control systems, home security products in Bangladesh, fully automated home, home automation us, Home automation, home automation Bangladesh, home lighting system,', '<p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">Home Automation or Smart Home allows the automatic grip of frequently used elements such as lighting, security, heating, ventilation &amp; air-conditioning (HVAC), music, and other home devices such as washer/dryers, ovens, or refrigerators/freezers,&nbsp;<span style=\"font-family: Calibri, &quot;sans-serif&quot;; font-size: 11pt;\">home WiFi control</span><span style=\"font-size: 1rem;\">&nbsp;in a manner that is personalized to the needs of each family.</span></p><p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">As technology continues to evolve in the Home Automation space, so does the need to organize different devices in a cohesive, centralized system. And that‚Äôs exactly what home automation hubs do: they ensure that all your connected devices talk to each other, giving you control over your entire home with the push of a button or through mobile apps just by a touch or by voice.</p><h1 style=\"line-height: 30px; font-size: 18px; font-family: &quot;Fira Sans&quot;; color: rgb(28, 28, 37); overflow-wrap: break-word;\"><b>Advantages of Home Automation Systems:</b></h1><p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">&nbsp