th:193.0pt;padding:0in 5.4pt 0in 5.4pt;\r\n  height:15.0pt\">\r\n  <h6 style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><font color=\"#ffffff\">home security products in Bangladesh,</font></h6>\r\n  </td>\r\n </tr>\r\n <tr style=\"mso-yfti-irow:5;height:15.0pt\">\r\n  <td width=\"257\" nowrap=\"\" valign=\"bottom\" style=\"width:193.0pt;padding:0in 5.4pt 0in 5.4pt;\r\n  height:15.0pt\">\r\n  <h6 style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><font color=\"#ffffff\">fully automated home,</font></h6>\r\n  </td>\r\n </tr>\r\n <tr style=\"mso-yfti-irow:6;height:15.0pt\">\r\n  <td width=\"257\" nowrap=\"\" valign=\"bottom\" style=\"width:193.0pt;padding:0in 5.4pt 0in 5.4pt;\r\n  height:15.0pt\">\r\n  <h6 style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><font color=\"#ffffff\">home automation us,</font></h6>\r\n  </td>\r\n </tr>\r\n <tr style=\"mso-yfti-irow:7;height:15.0pt\">\r\n  <td width=\"257\" nowrap=\"\" valign=\"bottom\" style=\"width:193.0pt;padding:0in 5.4pt 0in 5.4pt;\r\n  height:15.0pt\">\r\n  <h6 style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><font color=\"#ffffff\">Home automation,</font></h6>\r\n  </td>\r\n </tr>\r\n <tr style=\"mso-yfti-irow:8;height:15.0pt\">\r\n  <td width=\"257\" nowrap=\"\" valign=\"bottom\" style=\"width:193.0pt;padding:0in 5.4pt 0in 5.4pt;\r\n  height:15.0pt\">\r\n  <h6 style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><font color=\"#ffffff\">home automation Bangladesh,</font></h6>\r\n  </td>\r\n </tr>\r\n <tr style=\"mso-yfti-irow:9;mso-yfti-lastrow:yes;height:15.0pt\">\r\n  <td width=\"257\" nowrap=\"\" valign=\"bottom\" style=\"width:193.0pt;padding:0in 5.4pt 0in 5.4pt;\r\n  height:15.0pt\">\r\n  <h6 style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n  normal\"><font color=\"#ffffff\">home lighting system,</font></h6>\r\n  </td>\r\n </tr>\r\n</tbody></table></pre><p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word;\"><br></p>', '1-Sam', 0, '2023-08-16 12:00:51', '2024-01-24 06:42:53'),
(34, 'BMS EMS', 'bms-ems', NULL, 'automation-solution', 'bms-ems-automation-solution-2023-08-16-18-02-32-573466.png', 'Energy Management System (EMS) is an intelligent and complete solution that helps optimize energy usage, improve productivity and increase energy efficiency resulting in substantial cost savings. A Building Management System (BMS), otherwise known as a Building Automation System(BAS), is a computer-based control system installed in buildings that centralized controls and monitors the building‚Äôs mechanical and electrical equipment such as Heating, Ventilation and Air-conditioning (HVAC), Illumination (lighting) Control, Electric Power Control, Control Panel, Fire Alarm System, Plumbing, and Security System, Access Control, Closed-Circuit Television (CCTV), PA System, Alarm Monitor, Lifts, Elevators, other Engineering Systems etc. A BMS consists of Software and Hardware.', '<p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">Energy Management System (EMS) is an intelligent and complete solution that helps optimize energy usage, improve productivity and increase energy efficiency resulting in substantial cost savings.<br>A Building Management System (BMS), otherwise known as a Building Automation System(BAS), is a computer-based control system installed in buildings that centralized controls and monitors the building‚Äôs mechanical and electrical equipment such as Heating, Ventilation and Air-conditioning (HVAC), Illumination (lighting) Control, Electric Power Control, Control Panel, Fire Alarm System, Plumbing, and Security System, Access Control, Closed-Circuit Television (CCTV), PA System, Alarm Monitor, Lifts, Elevators, other Engineering Systems etc. A BMS consists of Software and Hardware.</p><p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\"><span style=\"font-weight: bolder;\">Advantage of EMS &amp; BMS/BAS:</span><br>‚Ä¢ Can manage &amp; monitor the building centrally or using remote management. You can also control &amp; monitor to individual subsystems<br>‚Ä¢ More effective building management, predictable energy consumption &amp; Save money and time during maintenance<br>‚Ä¢ Information is easier to access using the management system. Can detect problems earlier.</p>', '1-Sam Bd', 0, '2023-08-16 12:02:33', '2023-09-30 04:05:17'),
(35, 'BMS', 'bms', 'Building Management System in bangladesh', 'automation-solution', 'bms-2024-01-22-22-18-57-266297.jpg', 'Building Management System (BMS) is a comprehensive computer system. Once installed, the BMS communicates with all of the equipment and systems currently installed in the building', '<h2>BMS : Building Management System</h2><p>Building Management System (BMS) refers to a computer-based control system that is usually \r\ninstalled within buildings to monitor and regulate the building\'s electrical and mechanical equipment such as power system, lighting, and air-conditioning System, etc. to ensure energy saving and \r\nsustainability. The systems connected to a BMS usually represent a building\'s 70% energy usage in \r\nterms of the total energy utilized. It is essential for a BMS to be set up because they are crucial \r\nelements to intelligently manage the energy demand, for example, electrical systems, HVAC Systems, \r\nplumbing systems, Fire Protection system, electric power control, and Lighting Control.</p><h5>Benefits of Building Management System (BMS):</h5><ol><li>Better energy efficiency and thus reduced operational cost for the Building Owner\r\n</li><li>Faster fault diagnosis and resolution\r\n</li><li>Elevated safety and comfort for the building occupants\r\n</li><li>Enhanced security and safety of your long-term investment&nbsp;</li></ol>', '1-Sam Dev', 1, '2023-10-01 04:54:48', '2024-01-22 16:18:57'),
(36, 'Home & Hotel Automation', 'home-hotel', 'Home and Hotel automation in Bangladesh', 'automation-solution', 'home-hotel-automation-solution-2024-01-22-22-26-39-813026.jpg', 'Home and hotel automation solution in bangladesh, bms, Our Smart Home Solutions will simplify your life with reliable, intelligent, and user-friendly devices. With one device, anyone in your family can operate the lights, blinds, thermostats, intercom, security, concierge, and more.  For star rating Hotels, we provide Guest Room Management System (GRMS) from EAE Technology, Turkey. It is designed to ensure a mind-blowing experience for your guests. Our intelligent solutions are based on interactive technology that compliments the exceptional experience you want for your guests in all areas, such as restaurants, ballrooms, meeting rooms, and gym & fitness clubs. Implementing Automation System in a hospital helps improve overall hospital management, enhance staff‚Äôs working efficiency, save operating costs, and create a safe and efficient healthcare environment', '<h2>Automation Solution for Home and Hotel</h2><p>Our Smart Home Solutions will simplify your life with reliable, intelligent, and user-friendly devices. With one device, \r\nanyone in your family can operate the lights, blinds, thermostats, intercom, security, concierge, and more.</p><p>For star rating Hotels, we provide Guest Room Management System (GRMS) from EAE \r\nTechnology, Turkey. It is designed to ensure a mind-blowing experience for your guests. Our \r\nintelligent solutions are based on interactive technology that compliments the exceptional \r\nexperience you want for your guests in all areas, such as restaurants, ballrooms, meeting \r\nrooms, and gym &amp; fitness clubs.\r\nImplementing Automation System in a hospital helps improve overall hospital management, \r\nenhance staff‚Äôs working efficiency, save operating costs, and create a safe and efficient \r\nhealthcare environment<br></p>', '1-Sam Dev', 1, '2024-01-22 16:26:40', '2024-01-24 06:43:26'),
(37, 'Security Automation', 'security-automation', 'Security Automation Bangladesh', 'automation-solution', 'security-automation-automation-solution-2023-10-03-14-47-59-997428.jpg', 'Security automation is the use of technology that performs tasks with reduced human assistance in order to integrate security processes, applications, and infrastructure.', '<p><span style=\"color: rgb(21, 21, 21); font-family: &quot;Red Hat Text&quot;, RedHatText, Arial, sans-serif; font-size: 20px;\">Security automation is the use of technology that performs tasks with reduced human assistance in order to integrate security processes, applications, and infrastructure.</span></p><p><span style=\"color: rgb(51, 51, 51); font-family: DIN, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px;\">As cyber threats become more numerous and sophisticated, the concept of&nbsp;</span><font color=\"#424242\" style=\"background-color: rgb(255, 255, 255); font-family: DIN, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px;\">zero trust security</font><span style=\"color: rgb(51, 51, 51); font-family: DIN, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px;\">&nbsp;was created to help manage enterprise cyber risk. Instead of implicitly trusting internal users and systems, zero trust security approves or denies access requests on a case-by-case basis driven by role-based access controls (RBACs).</span></p><div id=\"\" class=\"cyberhub-section anchor white\" style=\"scroll-margin: 165px 0px 0px; padding: 20px; font-family: DIN, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\"><p style=\"margin-bottom: 20px; line-height: 1.6em; font-size: 18px; padding: 0px;\"><font color=\"#333333\">The granular security provided by a&nbsp;</font><font color=\"#424242\">zero-trust architecture</font><font color=\"#333333\">&nbsp;has significant benefits, but it also creates a significant amount of overhead. Security automation is essential to building a secure, scalable, and sustainable zero-trust strategy.</font></p></div><div id=\"\" class=\"cyberhub-section anchor white\" style=\"scroll-margin: 165px 0px 0px; padding: 20px; color: rgb(34, 34, 34); font-family: DIN, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;\"><h2 style=\"font-family: inherit; line-height: 1.1; color: rgb(51, 51, 51); margin-bottom: 20px; font-size: 38px; padding: 0px;\">The Main Benefits of Security Automation</h2><p style=\"margin-bottom: 20px; line-height: 1.6em; color: rgb(51, 51, 51); font-size: 18px; padding: 0px;\">The primary goals of security automation are to enable faster incident response and to increase security agility. These two objectives are accomplished in a few different ways.</p></div>', '1-Sam Dev', 1, '2023-10-03 08:48:00', '2023-12-17 07:35:37'),
(38, 'HVAC And BBT', 'hvac-and-bbt', NULL, 'hvac-and-bbt', 'hvac-and-bbt-electrical-solution-2023-10-07-13-03-36-736782.jpeg', 'Bangladesh is a growing economy looking forward to achieving double-digit GDP  growth shortly. Overall the Standard of life of the dwellers of urban & rural areas has  been going up steadily. On the other hand, Bangladesh is a tropical country whose  climate is naturally hot and humid. Along with the effect of global warming, the average  temperature has been increasing rapidly, and the necessity for HVAC solutions is  growing sharply', '<p>Bangladesh is a growing economy looking forward to achieving double-digit GDP \r\ngrowth shortly. Overall the Standard of life of the dwellers of urban &amp; rural areas has \r\nbeen going up steadily. On the other hand, Bangladesh is a tropical country whose \r\nclimate is naturally hot and humid. Along with the effect of global warming, the average \r\ntemperature has been increasing rapidly, and the necessity for HVAC solutions is \r\ngrowing sharply</p><p><br></p><p><br></p><p>Nowadays, building planners and engineers prefer busbar trunking to cable installation \r\nfor power transmission and distribution for the following reasons:\r\n‚Ä¢ Easy and transparent Electricity Planning.\r\n‚Ä¢ Flexible adaptation to changes in the production layout or functionalities of the \r\nbuilding.\r\n‚Ä¢ Very low fire risk than high power carrying cable.\r\n‚Ä¢ Long Service Life.<br></p>', '12-Techno Apogee', 2, '2023-10-07 07:03:36', '2023-10-07 07:03:36'),
(205, 'Cleanroom & Acoustic Solution', 'clean-room-and-acoustic-solution', 'Cleanroom and Acoustic Solution  in Bangladesh', 'hvac-and-bbt', 'clean-room-and-acoustic-solution-hvac-and-bbt-2024-01-23-12-00-37-661493.PNG', 'Apogee Engineering Ltd (AEL). is a solution provider of Clean Room in Bangladesh. Clean rooms are rooms with controlled environments having a low level of contaminants such as airborne particles, dust, aerosol particles, and chemical vapours. It is designed to avoid dust, airborne organisms, or vaporized particles to achieve the desired level of Air Quality for a clean & germ-free environment. Such rooms are commonly needed for Pharmaceutical Plants, Hospitals, Semiconductor Factories, Mobile Assembly Plants, Research Laboratories, Etc. We represent Line-Link Purification Technology Co., Ltd, China, a world-reputed manufacturer of all components of Cleanroom Solutions since 2003, having state-of-the-art manufacturing facilities in 6 provinces of China.', '<h2><b>Clean Room and Acoustic Solution</b></h2><p>Apogee Engineering Ltd (AEL). is a solution provider of Clean Room in Bangladesh. \r\nClean rooms are rooms with controlled environments having a low level of \r\ncontaminants such as airborne particles, dust, aerosol particles, and chemical \r\nvapours. It is designed to avoid dust, airborne organisms, or vaporized particles to \r\nachieve the desired level of Air Quality for a clean &amp; germ-free environment. Such \r\nrooms are commonly needed for Pharmaceutical Plants, Hospitals, Semiconductor \r\nFactories, Mobile Assembly Plants, Research Laboratories, Etc. We represent \r\nLine-Link Purification Technology Co., Ltd, China, a world-reputed manufacturer of all \r\ncomponents of Cleanroom Solutions since 2003, having state-of-the-art \r\nmanufacturing facilities in 6 provinces of China.</p><p><br></p><h5>There are various parts of a cleanroom system, such as: </h5><ul><li>\r\n‚Ä¢ Cleanroom Panels: Wall Panels and Ceiling Panels. </li><li>\r\n‚Ä¢ Cleanroom Doors: Steel Door, HPL Door, Emergency Exit Door. </li><li>\r\n‚Ä¢ Cleanroom Windows: Square Windows, Round Windows, Etc. </li><li>\r\n‚Ä¢ Filters: Primary, Medium &amp; HEPA Filters. </li><li>\r\n‚Ä¢ Cleanroom Flooring: PVC Flooring, Epoxy Flooring. </li><li>\r\n‚Ä¢ Cleanroom Equipment: Passbox, Laminar Air Flows, Weighing &amp;\r\nDispensing Booths, SS Furniture&nbsp;<br></li></ul>', '1-Sam Dev', 1, '2024-01-23 06:00:39', '2024-01-24 08:37:25');
