INSERT INTO `product_service_subs` (`id`, `__prosername`, `__proserslug`, `__prosertitle`, `__prosermaincateslug`, `__prosermaincateid`, `__proserheadimage`, `__proserkeyword`, `__proserdescription`, `added_by`, `is_active`, `created_at`, `updated_at`) VALUES
(1, 'Electrical Safety Audits', 'electrical-safety-audits', 'Electrical Safety Audits in Bangladesh', 'electrical-fire-safety-audit-consultancy-dife', '3', 'electrical-safety-audits-electrical-fire-safety-audit-consultancy-dife-2023-08-17-14-30-40-822607.jpg', 'Apogee Consultancy is a reliable to offers that excellent services for Electrical Safety Audits. We have a team of highly experienced engineers and other workers, all of whom are efficient in furnishing these services as per predefined guidelines of the industry', '<p style=\"margin-bottom: 26px; line-height: 1.8; color: rgb(69, 69, 69); font-family: poppins, sans-serif; font-size: 15px;\"><span style=\"color: rgb(122, 122, 122); font-family: Roboto, sans-serif; font-size: 16px;\">Apogee Consultancy is a reliable to offers that excellent services for Electrical Safety Audits. We have a team of highly experienced engineers and other workers, all of whom are efficient in furnishing these services as per predefined guidelines of the industry. Further, we make use of modern machines and Require NFPA 70, BNBC Standard in order to perform these audits. Our offered audits are highly appreciated by our clients for their accuracy, effective documentation, and timely completion.</span></p><ul><li style=\"font-weight: 700; line-height: 34px; font-size: 26px; font-family: &quot;Fira Sans&quot;; color: rgb(28, 28, 37); overflow-wrap: break-word;\"><span style=\"font-weight: bolder;\">Work Process:-</span></li></ul><p style=\"list-style: none; line-height: 2.2;\"></p><p style=\"list-style: none; line-height: 2.2;\"><ul style=\"overflow-wrap: break-word;\"></ul></p><ol><li style=\"list-style: none; line-height: 2.2;\">Audit plan</li><li style=\"list-style: none; line-height: 2.2;\">Hazardous area analysis</li><li style=\"list-style: none; line-height: 2.2;\">Execution</li><li style=\"list-style: none; line-height: 2.2;\">Site assessment</li><li style=\"list-style: none; line-height: 2.2;\">Hazardous area classification</li><li style=\"list-style: none; line-height: 2.2;\">Documentation Report</li></ol>', '1-Sam Dev', 1, '2023-08-17 08:30:40', '2023-12-14 11:13:06'),
(2, 'Fire Safety Audits & Risk Assessments', 'fire-safety-audits-risk-assessments', 'Fire Safety Audits & Risk Assessments in Bangladesh', 'electrical-fire-safety-audit-consultancy-dife', '3', 'fire-safety-audits-risk-assessments-electrical-fire-safety-audit-consultancy-dife-2023-08-18-20-36-07-266145.jpg', 'The occurrence of any fire has the potential to cause severe damage to both life and property. A Fire Safety Audit is the most effective tool for assessing the fire safety standards of your facility. It helps the owners to identify areas where improvement can be made and develop an action plan, in addition to emergency preparedness and mock drills.', '<p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">The occurrence of any fire has the potential to cause severe damage to both life and property. A Fire Safety Audit is the most effective tool for assessing the fire safety standards of your facility. It helps the owners to identify areas where improvement can be made and develop an action plan, in addition to emergency preparedness and mock drills.</p><p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">Techno Apogee is an Enlisted Consultant for Fire Safety Audit of DIFE (Department of Inspection for Factories and Establishments) for its reliable support &amp; excellent services to clients. It is a legal requirement for every building owner to undertake a fire safety inspection of the essential services installed within their property. Essentially the same service as a fire safety audit and risk assessment, this is something we can do and which can be instrumental in creating more efficient buildings.</p><h5 style=\"font-weight: 700; line-height: 32px; font-size: 22px; font-family: &quot;Fira Sans&quot;; color: rgb(28, 28, 37); overflow-wrap: break-word;\"><span style=\"font-weight: bolder;\">The main focus of these fire safety audits is:</span></h5><ul style=\"padding-left: 1.59rem; margin-bottom: 0px; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\"><li style=\"list-style: none; line-height: 2.2;\">Verification of statutory compliance with respect to BNBC &amp; NFPA (Electrical) standards.</li><li style=\"list-style: none; line-height: 2.2;\">Review of chemical compatibility in storage areas and to suggest appropriate fire loss control measures</li><li style=\"list-style: none; line-height: 2.2;\">Review of electrical hazards which are potential causes of fire</li><li style=\"list-style: none; line-height: 2.2;\">Review of fire detection measures adopted &amp; to suggest suitable improvement measures</li><li style=\"list-style: none; line-height: 2.2;\">Review of the various active (fire hydrant, sprinkler, portable fire extinguishers) and passive fire protection requirements for chemical storage and handling areas and to suggest improvements as necessary</li><li style=\"list-style: none; line-height: 2.2;\">Review of Fire Alarm system and emergency fire system of plant</li><li style=\"list-style: none; line-height: 2.2;\">Review of contractor safety awareness (chemical spill, fire fighting, emergency communication, knowledge of plant hazards &amp; safety regulations) and to recommend suitable improvement measures to enhance contractor safety</li></ul>', '1-Sam Dev', 1, '2023-08-18 14:36:07', '2023-12-14 11:12:56'),
(3, 'NOC (No Objection Certificate )', 'noc-no-objection-certificate', 'NOC (No Objection Certificate ) in Bangladesh', 'noc-fire-safety-plan-for-fscd', '5', 'noc-no-objection-certificate-2023-09-02-16-23-00-560302.jpg', 'Techno Apogee is an Enlisted Consultant for NOC (No Objection Certificate) & Fire Safety Plan of FSCD (Fire Service & Civil Defence). NOC is the first step to getting Fire Safety Plan from FSCD. NOC indicates that the building fire safety is designed as per the norms and regulations. The investor should apply for Approval of Fire Fighting Floor Plan (NOC) before starting the building construction.', '<p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">Techno Apogee is an Enlisted Consultant for NOC (No Objection Certificate) &amp; Fire Safety Plan of FSCD (Fire Service &amp; Civil Defence). NOC is the first step to getting Fire Safety Plan from FSCD. NOC indicates that the building fire safety is designed as per the norms and regulations. The investor should apply for Approval of Fire Fighting Floor Plan (NOC) before starting the building construction. &nbsp;We have a team of highly experienced engineers and other workers, all of whom are efficient in furnishing these services as per predefined guidelines for Industry. Further, we make use of modern machines and technologies in order to perform this NOC Design Assessment &amp; Establish. Our Proposed Design is highly appreciated by our clients for its accuracy, effective documentation, and timely completion.</p><p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\"></p><h5 style=\"font-weight: 700; line-height: 32px; font-size: 22px; font-family: &quot;Fira Sans&quot;; color: rgb(28, 28, 37); overflow-wrap: break-word;\"><span style=\"font-weight: bolder;\">Typical scope of the study</span></h5><ul style=\"padding-left: 1.59rem; margin-bottom: 25px; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\"><li style=\"list-style: none; line-height: 2.2;\">Verification of statutory compliance with respect to BNBC &amp; NFPA (Electrical) standards.</li><li style=\"list-style: none; line-height: 2.2;\">Physical inspection to identify Fire Separation Needed for Fire hazards and to Design Fire &nbsp;safety solutions</li></ul><h5 style=\"font-weight: 700; line-height: 32px; font-size: 22px; font-family: &quot;Fira Sans&quot;; color: rgb(28, 28, 37); overflow-wrap: break-word;\"><span style=\"font-weight: bolder;\">Required Design for NOC:</span></h5><ul style=\"padding-left: 1.59rem; margin-bottom: 0px; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\"><li style=\"list-style: none; line-height: 2.2;\">Fire Detection System Design</li><li style=\"list-style: none; line-height: 2.2;\">Fire Protection /Hydrant / Sprinkler System Design</li><li style=\"list-style: none; line-height: 2.2;\">Fire Extinguishing System Design</li><li style=\"list-style: none; line-height: 2.2;\">Fire Separation Drawing Design</li><li style=\"list-style: none; line-height: 2.2;\">Evacuation Plan</li><li style=\"list-style: none; line-height: 2.2;\">Utility Building Safety Drawing Design</li></ul>', '1-Sam Dev', 1, '2023-08-18 14:37:49', '2023-12-14 11:11:40'),
(4, 'Fire Safety Plan', 'fire-safety-plan', 'Fire Safety Plan in Bangladesh', 'noc-fire-safety-plan-for-fscd', '5', 'fire-safety-plan-noc-fire-safety-plan-for-fscd-2023-08-18-20-39-03-268448.jpg', 'Techno Apogee is an Enlisted Consultant for NOC (No Objection Certificate) & Fire Safety Plan of FSCD (Fire Service & Civil Defence). Fire Safety Plan is the second Step. After get NOC Investor Should arrange all fire Safety works as per Design of NOC and after assessment of Expert Auditor of FSCD Fire safety Plan will be provided depending on satisfactory works. Fire Safety Plan indicates that the building fire safety is works have done as per the norms and regulations.', '<p style=\"margin-bottom: 26px; line-height: 1.8; color: rgb(69, 69, 69); font-family: Poppins, sans-serif; font-size: 15px;\">Techno Apogee is an Enlisted Consultant for NOC (No Objection&nbsp;Certificate) &amp; Fire Safety Plan of FSCD (Fire Service &amp; Civil Defence). Fire Safety Plan is the second Step. After get NOC Investor Should arrange all fire Safety works as per Design of NOC and after assessment of Expert Auditor of FSCD Fire safety Plan will be provided depending on satisfactory works. Fire Safety Plan indicates that the building fire safety is works have done as per the norms and regulations. We have a team of highly experienced engineers and other workers, all of whom are efficient in furnishing these services as per predefined guidelines for Industry. Further, we make use of modern machines and technologies in order to perform this Fire Safety Plan Design, Assessment &amp; Establish. Our as Build Design is highly appreciated by our clients for its accuracy, effective documentation and timely completion.</p><h5 style=\"margin-bottom: 26px; font-weight: 600; line-height: 32px; font-size: 24px; font-family: Poppins, sans-serif; color: rgb(10, 10, 10);\"><span style=\"font-weight: bolder; font-family: var( --e-global-typography-text-font-family ), Sans-serif;\">Typical scope of study</span></h5><ul style=\"padding-left: 0px; margin-bottom: 0px; list-style-position: outside; list-style-image: none; color: rgb(69, 69, 69); font-family: Poppins, sans-serif; font-size: 15px;\"><li>Verification of statutory compliance with respect to BNBC &amp; NFPA (Electrical) standard.</li><li>Physical inspection to identify Fire Separation Needed for Fire hazards and to Design Fire &nbsp;safety solutions</li></ul><h5 style=\"margin-bottom: 26px; font-weight: 600; line-height: 32px; font-size: 24px; font-family: Poppins, sans-serif; color: rgb(10, 10, 10);\"><span style=\"font-weight: bolder;\">Required Design to be integrated for Fire Safety Plan:</span></h5><ul style=\"padding-left: 0px; margin-bottom: 0px; list-style-position: outside; list-style-image: none; color: rgb(69, 69, 69); font-family: Poppins, sans-serif; font-size: 15px;\"><li>Fire Detection System Design</li><li>Fire Protection /Hydrant / Sprinkler System Design</li><li>Fire Extinguishing System Design</li><li>Fire Separation Drawing Design</li><li>Evacuation Plan</li><li>Utility Building Safety Drawing Design</li><li>Substation, MDB,DB &amp; SDB Design.</li><li>Lightning Protection System</li></ul>', '1-Sam Dev', 1, '2023-08-18 14:39:03', '2023-12-14 11:11:52'),
(5, 'Fire Hydrant and Sprinkler Systems Design', 'fire-hydrant-and-sprinkler-systems-design', 'Fire Hydrant and Sprinkler Systems Design in bangladesh', 'others-design-consultancy-support', '6', 'fire-hydrant-and-sprinkler-systems-design-others-design-consultancy-support-2023-08-18-20-50-09-920927.jpg', 'In Commercial or Residential buildings, a fire hydrant system is a safety measure or emergency equipment required in some buildings that comprise a series of components that when assembled provide a source of water to assist fire authorities in a fire. Apogee Consultancy to design risk management of fire by NFPA 13, 14, 20 & BNBC for risk analysis to determine whether Fire Protection Systems are required.', '<p style=\"margin-bottom: 26px; line-height: 1.8;\"><span style=\"color: rgb(122, 122, 122); font-family: Roboto, sans-serif;\">In Commercial or Residential buildings, a fire hydrant system is a safety measure or emergency equipment required in some buildings that comprise a series of components that when assembled provide a source of water to assist fire authorities in a fire. Apogee Consultancy to design risk management of fire by NFPA 13, 14, 20 &amp; BNBC for risk analysis to determine whether Fire Protection Systems are required.</span></p><h4 style=\"font-weight: 700; line-height: 34px; font-size: 26px; font-family: &quot;Fira Sans&quot;; color: rgb(28, 28, 37); overflow-wrap: break-word;\"><span style=\"font-weight: bolder;\">Work Process:-</span></h4><ul style=\"padding-left: 1.59rem; margin-bottom: 0px; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\"><li style=\"list-style: none; line-height: 2.2;\"><ul style=\"overflow-wrap: break-word;\"><li style=\"list-style: none; line-height: 2.2;\">Working Plan</li><li style=\"list-style: none; line-height: 2.2;\">Site Visit/ Data Collection</li><li style=\"list-style: none; line-height: 2.2;\">Site/ Data Analysis</li><li style=\"list-style: none; line-height: 2.2;\">Hydraulic Calculation</li><li style=\"list-style: none; line-height: 2.2;\">Drawing Design</li><li style=\"list-style: none; line-height: 2.2;\">Documentation</li></ul></li></ul><p style=\"margin-bottom: 26px; line-height: 1.8;\"><br style=\"color: rgb(69, 69, 69); font-family: Poppins, sans-serif; font-size: 15px;\"></p>', '1-Sam Dev', 1, '2023-08-18 14:50:09', '2023-12-14 11:10:34'),
(6, 'Fire Detection / Alarm Systems Design', 'fire-detection-alarm-systems-design', 'Fire Detection / Alarm Systems Design in bangladesh', 'others-design-consultancy-support', '6', 'fire-detection-alarm-systems-design-others-design-consultancy-support-2023-08-18-20-51-11-042484.jpg', 'Fire Detection & alarm Systems that are correctly designed can provide early warning of fire that can help lives & products protect properly. For building owners and facilities management professionals, fire alarm systems can be both a burden and a necessity. Apogee Consultancy to design risk management of fire in accordance with NFPA 72 & BNBC for risk analysis to determine whether Fire Detection Systems is required.', '<p style=\"margin-bottom: 26px; line-height: 1.8; color: rgb(69, 69, 69); font-family: Poppins, sans-serif; font-size: 15px;\"><span style=\"color: rgb(122, 122, 122); font-family: Roboto, sans-serif; font-size: 16px;\">Fire Detection &amp; Alarm Systems that are correctly designed can provide early warning of fire that can help lives &amp; products protect properly. For building owners and facilities management professionals, fire alarm systems can be both a burden and a necessity. Apogee Consultancy to design risk management of fire in accordance with NFPA 72 &amp; BNBC for risk analysis to determine whether Fire Detection Systems are required.</span></p><h4 style=\"font-weight: 700; line-height: 34px; font-size: 26px; font-family: &quot;Fira Sans&quot;; color: rgb(28, 28, 37); overflow-wrap: break-word;\"><span style=\"font-weight: bolder;\">Work Process:-</span></h4><ul style=\"padding-left: 1.59rem; margin-bottom: 0px; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\"><li style=\"list-style: none; line-height: 2.2;\"><ul style=\"overflow-wrap: break-word;\"><li style=\"list-style: none; line-height: 2.2;\">Working Plan</li><li style=\"list-style: none; line-height: 2.2;\">Site Visit/ Data Collection</li><li style=\"list-style: none