(7, 'Fire Safety Audits', 'fire-safety-audits', 'Fire Safety Audits in bangladesh', 'others-design-consultancy-support', '6', 'fire-safety-audits-others-design-consultancy-support-2023-08-18-20-48-41-005392.jpg', 'The occurrence of any fire has the potential to cause severe damage to both life and property. A Fire Safety Audit is the most effective tool for assessing the fire safety standards of your facility. It helps the owners to identify areas where improvement can be made and develop an action plan, in addition to emergency preparedness and mock drills.', '<p style=\"margin-bottom: 26px; line-height: 1.8;\"><span style=\"color: rgb(122, 122, 122); font-family: Roboto, sans-serif;\">The occurrence of any fire has the potential to cause severe damage to both life and property. A Fire Safety Audit is the most effective tool for assessing the fire safety standards of your facility. It helps the owners to identify areas where improvement can be made and develop an action plan, in addition to emergency preparedness and mock drills.</span></p><h4 style=\"font-weight: 700; line-height: 34px; font-size: 26px; font-family: &quot;Fira Sans&quot;; color: rgb(28, 28, 37); overflow-wrap: break-word;\"><span style=\"font-weight: bolder;\">Work Process:-</span></h4><ul style=\"padding-left: 1.59rem; margin-bottom: 0px; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\"><li style=\"list-style: none; line-height: 2.2;\"><ul style=\"overflow-wrap: break-word;\"><li style=\"list-style: none; line-height: 2.2;\">Audit plan</li><li style=\"list-style: none; line-height: 2.2;\">Hazardous area analysis</li><li style=\"list-style: none; line-height: 2.2;\">Execution</li><li style=\"list-style: none; line-height: 2.2;\">Site assessment</li><li style=\"list-style: none; line-height: 2.2;\">Hazardous area classification</li><li style=\"list-style: none; line-height: 2.2;\">Documentation Report</li></ul></li></ul><p style=\"margin-bottom: 26px; line-height: 1.8;\"><br style=\"color: rgb(69, 69, 69); font-family: Poppins, sans-serif; font-size: 15px;\"></p>', '1-Sam Dev', 1, '2023-08-18 14:48:41', '2023-12-14 11:10:50'),
(8, 'Electrical Single-Line Diagram (SLD)', 'electrical-single-line-diagram-sld', 'Electrical Single-Line Diagram (SLD) in bangladesh', 'others-design-consultancy-support', '6', 'electrical-single-line-diagram-sld-others-design-consultancy-support-2023-08-18-20-52-57-184933.jpg', 'Apogee Consultancy provides Single Line Diagram is a user-friendly interface for creating and managing the network database used for schematic network visualization. The single-line diagram is the blueprint for electrical system analysis. It is the first step in preparing a critical response plan, allowing you to become thoroughly familiar with the electrical transmission system layout and design to required to maintain Standards.', '<p style=\"margin-bottom: 26px; line-height: 1.8; color: rgb(69, 69, 69); font-family: Poppins, sans-serif; font-size: 15px;\"><span style=\"color: rgb(122, 122, 122); font-family: Roboto, sans-serif; font-size: 16px;\">Apogee Consultancy provides Single Line Diagram is a user-friendly interface for creating and managing the network database used for schematic network visualization. The single-line diagram is the blueprint for electrical system analysis. It is the first step in preparing a critical response plan, allowing you to become thoroughly familiar with the electrical transmission system layout and design to required to maintain Standards.</span></p><h4 style=\"font-weight: 700; line-height: 34px; font-size: 26px; font-family: &quot;Fira Sans&quot;; color: rgb(28, 28, 37); overflow-wrap: break-word;\"><span style=\"font-weight: bolder;\">Work Process:-</span></h4><ul style=\"padding-left: 1.59rem; margin-bottom: 0px; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\"><li style=\"list-style: none; line-height: 2.2;\"><ul style=\"overflow-wrap: break-word;\"><li style=\"list-style: none; line-height: 2.2;\">Working Plan</li><li style=\"list-style: none; line-height: 2.2;\">Data Collection</li><li style=\"list-style: none; l