(9, 'Lightning Protection System (LPS) Design', 'lightning-protection-system-lps-design', 'Lightning Protection System (LPS) Design in bangladesh', 'others-design-consultancy-support', '6', 'lightning-protection-system-lps-design-others-design-consultancy-support-2023-08-18-20-54-16-259359.jpg', 'The reason for the mandatory requirement of lighting protection is that only 50% of the lighting impulse will go directly to earth, the other 50% will travel through the cross bond onto the incoming panel and out onto the electrical circuits in the installation. This creates a massive risk to the life and to property of any industrial installation.', '<p class=\"nitro-offscreen\" style=\"margin-top: 0in; margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(122, 122, 122); font-family: Roboto, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-SG\" style=\"font-family: Arial, sans-serif; color: rgb(68, 68, 68); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">A&nbsp;<span style=\"font-weight: bolder;\">Lightning Protection System‚Äôs</span>&nbsp;only purpose is to ensure the safety of a building and its occupants if lightning happens to hit it directly, a task accomplished by providing a good, safe path to the ground for the lightning to follow.&nbsp;</span></p><p class=\"nitro-offscreen\" style=\"margin-top: 0in; margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(122, 122, 122); font-family: Roboto, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-SG\" style=\"font-family: Arial, sans-serif; color: rgb(17, 17, 17); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">The&nbsp;<span style=\"font-weight: bolder;\">reason</span>&nbsp;for the mandatory&nbsp;<span style=\"font-weight: bolder;\">requirement</span>&nbsp;of&nbsp;<span style=\"font-weight: bolder;\">lighting</span>&nbsp;<span style=\"font-weight: bolder;\">protection</span>&nbsp;is that only 50% of the lighting impulse will go directly to earth, the other 50% will travel through the cross bond onto the incoming panel and out onto the electrical circuits in the installation. This creates a massive risk to the life and to property of any industrial installation.</span></p><p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(122, 122, 122); font-family: Roboto, sans-serif;\">Design of Lightning Protection System (LPS) is an important part of any building General Principles This is part contains information about the risk of Lightning Strikes, Lightning Characteristics, and the resulting parameters for simulating the effects of Lightning Strikes.</p><p class=\"nitro-offscreen\" style=\"margin-top: 0in; margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(122, 122, 122); font-family: Roboto, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-SG\" style=\"font-family: Arial, sans-serif; color: rgb(17, 17, 17); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"></span></p><p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(122, 122, 122); font-family: Roboto, sans-serif;\">Apogee Consultancy Ltd has the expertise in designing the LPS in accordance with IEC 62305-2 (EN 62305-2)/NFPA 780/BNBC for risk analysis to determine whether Lightning Protection is required and how the maximum protection can be ensured by doing efficient design and perfect installation</p><h4 style=\"font-weight: 700; line-height: 34px; font-size: 26px; font-family: &quot;Fira Sans&quot;; color: rgb(28, 28, 37); overflow-wrap: break-word;\"><span style=\"font-weight: bolder;\">Work Process:-</span></h4><ul style=\"padding-left: 1.59rem; margin-bottom: 0px; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\"><li style=\"list-style: none; line-height: 2.2;\"><ul style=\"overflow-wrap: break-word;\"><li style=\"list-style: none; line-height: 2.2;\">Working Plan</li><li style=\"list-style: none; line-height: 2.2;\">Site Visit/ Data Collection</li><li style=\"list-style: none; line-height: 2.2;\">Site/ Data Analysis</li><li style=\"list-style: none; line-height: 2.2;\">Drawing Design</li></ul></li></ul>', '1-Sam Dev', 1, '2023-08-18 14:54:16', '2023-12-14 11:11:06'),
(11, 'UL Listed Addressable Fire Detection Systems', 'ul-listed-addressable-fire-detection-systems', 'UL Listed Addressable Fire Detection Systems in bangladesh', 'fire-detection-system', '17', 'ul-listed-addressable-fire-detection-systems-fire-detection-system-2023-08-19-23-02-55-134072.jpg', 'When installing a fire alarm system it is important to ensure that the system meets all the necessary requirements, thus providing safe and reliable fire detection. There are several types of Certification of detection Systems but we offered generally (The Loss Prevention Certification Board ) LPCB  Approved & Another is (Underwriters Laboratories) UL Listed. UL is an independent product safety certification organization that‚Äôs more than 100 years old', '<p><span style=\"color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">When installing a fire alarm system it is important to ensure that the system meets all the necessary requirements, thus providing safe and reliable fire detection. There are several types of Certification of detection Systems but we offered generally (The Loss Prevention Certification Board ) LPCB&nbsp; Approved &amp; Another is (Underwriters Laboratories) UL Listed. UL is an independent product safety certification organization that‚Äôs more than 100 years old. UL develops standards and procedures for products, materials, components, assemblies, tools, and equipment as they apply to product safety.</span><br></p>', '1-Sam Dev', 1, '2023-08-19 17:02:55', '2023-12-14 11:08:30'),
(12, 'LPCB Approved Addressable Fire Detection Systems', 'lpcb-approved-addressable-fire-detection-systems', 'LPCB Approved Addressable Fire Detection Systems in bangladesh', 'fire-detection-system', '17', 'lpcb-approved-addressable-fire-detection-systems-fire-detection-system-2023-08-19-23-03-57-520803.jpg', 'When installing a fire alarm system it is important to ensure that the system meets all the necessary requirements, thus providing safe and reliable fire detection. There are several types of Certification of detection Systems but we offered generally (The Loss Prevention Certification Board ) LPCB  Approved & Another is (Underwriters Laboratories) UL Listed.', '<p><span style=\"color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">When installing a fire alarm system it is important to ensure that the system meets all the necessary requirements, thus providing safe and reliable fire detection. There are several types of Certification of detection Systems but we offered generally (The Loss Prevention Certification Board ) LPCB &nbsp;Approved &amp; Another is (Underwriters Laboratories) UL Listed. LPCB has been working for more than 100 years to set the high standards needed to make certain that fire and security products function effectively, offering third-party approval certifying that products and services have met, and will continue to meet, suitable standards.&nbsp;By selecting LPCB-approved products they can reduce fire safety risks, demonstrate due diligence and abstain from wasting time researching products and wasting money purchasing unsuitable equipment.</span><br></p>', '1-Sam Dev', 1, '2023-08-19 17:03:57', '2023-12-14 11:08:40'),
(13, 'Aspiration Smoke Detection Systems', 'aspiration-smoke-detection-systems', 'Aspiration Smoke Detection Systems in bangladesh', 'fire-detection-system', '17', 'aspiration-smoke-detection-systems-fire-detection-system-2023-08-19-23-06-03-609137.jpg', 'Fire Alarm Aspiration Sensing Technology‚Ñ¢ is a new generation of smoke detectors from Honeywell, which uses advanced technologies and software to deliver the earliest and most accurate smoke detection. The device range is designed to protect people and assets in even the most challenging environments where standard detection methods fail or face false alarms, or in areas that may not previously have been protected.', '<p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 18px;\"><a href=\"https://technoapogee.com/en/product-and-service/fire-detection-system\" style=\"color: rgb(37, 37, 37); transition: all 0.3s ease 0s; cursor: pointer; box-shadow: none; outline: none !important;\"><span style=\"font-weight: bolder;\">The installation</span></a>, testing, and commissioning of aspirating smoke detection (ASD) systems are governed by several codes and standards. We follow codes and standards that are required to be referenced while designing ASD systems National Fire Alarm and Signaling Code (<span style=\"font-weight: bolder;\"><a href=\"https://www.nfpa.org/codes-and-standards/all-codes-and-standards/list-of-codes-and-standards/detail?code=72\" style=\"color: rgb(37, 37, 37); transition: all 0.3s ease 0s; cursor: pointer; box-shadow: none; outline: none !important;\">NFPA</a></span>&nbsp;72,75,76).</p><p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 18px;\">Fire Alarm Aspiration Sensing Technology‚Ñ¢ is a new generation of smoke detectors from Honeywell, which uses advanced technologies and software to deliver the earliest and most accurate smoke detection. The device range is designed to protect people and assets in even the most challenging environments where standard detection methods fail or face false alarms, or in areas that may not previously have been protected.</p><h5 style=\"font-weight: 700; line-height: 32px; font-size: 22px; font-family: &quot;Fira Sans&quot;; color: rgb(28, 28, 37); overflow-wrap: break-word;\">Advantage of Aspiration Systems :</h5><ol style=\"padding-left: 1.59rem; margin-bottom: 25px; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif; font-size: 18px;\"><li style=\"margin-bottom: 0px; line-height: 2.2;\">Earliest warning detection with the highest level of false alarm immunity.</li><li style=\"margin-bottom: 0px; line-height: 2.2;\">Reduced installation and maintenance costs.</li><li style=\"margin-bottom: 0px; line-height: 2.2;\">Extended device lifetime using advanced filtration techniques.</li><li style=\"margin-bottom: 0px; line-height: 2.2;\">Remote monitoring capabilities and richer reporting via TCP/IP connectivity.</li></ol>', '1-Sam Dev', 1, '2023-08-19 17:06:03', '2023-12-14 11:09:32'),
(14, 'Fire Hydrant Systems', 'fire-hydrant-systems', 'Fire Hydrant Systems in bangladesh', 'fire-protection-systems', '18', 'fire-hydrant-systems-lightning-protection-system-2023-08-19-23-07-48-270246.jpg', 'Fire Hydrant Systems consist of a System of pipework connected directly to the water supply main to provide water to each and every hydrant outlet and is intended to provide water for the firemen to fight a fire. The water is discharged into the fire engine form which is then pumped and sprayed over the fire. Where the water supply is not reliable or inadequate, hydrant pumps should be provided to pressurize the fire mains.', '<p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">Fire Hydrant Systems consist of a System of pipework connected directly to the water supply main to provide water to each and every hydrant outlet and is intended to provide water for the firemen to fight a fire. The water is discharged into the fire engine form which is then pumped and sprayed over the fire. Where the water supply is not reliable or inadequate, hydrant pumps should be provided to pressurize the fire mains.</p><p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">Fire Hydrant Protection Systems are Designed to fight fires of huge proportions, which are all classes of risks. It is designed to be in operation even if a part of the affected structure collapses. Guidelines &amp; Approval for Hydrant Systems is available from Various National &amp; International Organizations like NFPA, BNBC Etc.</p><h5 style=\"font-weight: 700; line-height: 32px; font-size: 22px; font-family: &quot;Fira Sans&quot;; color: rgb(28, 28, 37); overflow-wrap: break-word;\">Advantages of Fire Hydrant &amp; Sprinkler system:</h5><ul style=\"padding-left: 1.59rem; margin-bottom: 0px; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\"><li style=\"list-style: none; line-height: 2.2;\">Hydrant Systems are strong with long life and are used for medium to large-sized fires.</li><li style=\"list-style: none; line-height: 2.2;\">Sprinkler Systems are low maintenance, does not leak water &amp; 24-hour active system that does not require your help</li><li style=\"list-style: none; line-height: 2.2;\">A sprinkler System is a very effective method to suppress the fire.</li></ul>', '1-Sam Dev', 1, '2023-08-19 17:07:48', '2023-12-14 11:07:03'),
(15, 'Fire Sprinkler Systems', 'fire-sprinkler-systems', 'Fire Sprinkler Systems in bangladesh', 'fire-protection-systems', '18', 'fire-sprinkler-systems-lightning-protection-system-2023-08-19-23-09-43-272651.jpg', 'Fire sprinkler system Wet sprinkler system Dry sprinkler system Ordinary temperature sprinkler head Intermediate temperature sprinkler head High temperature sprinkler head Fire protection engineer Fire safety Fire prevention Building code Sprinkler head Sprinkler pipe Sprinkler valve Water tank Pump Alarm system Maintenance', '<p data-sourcepos=\"1:1-1:284\" style=\"margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">A fire sprinkler system is a system of pipes installed in a building that contains water under pressure. The pipes are fitted with sprinkler heads that are activated when heat from a fire causes them to burst. The water then flows out of the sprinkler heads and extinguishes the fire.</p><p data-sourcepos=\"3:1-3:171\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Fire sprinkler systems are one of the most effective ways to prevent fire deaths and injuries. They are also very reliable, and can often contain a fire before it spreads.</p><p data-sourcepos=\"5:1-5:100\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">There are two main types of fire sprinkler systems: wet sprinkler systems and dry sprinkler systems.</p><ul data-sourcepos=\"7:1-9:0\" style=\"margin-top: 4px; margin-bottom: 4px; padding-inline-start: 36px; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\"><li data-sourcepos=\"7:1-7:133\" style=\"margin-bottom: 10px;\">Wet sprinkler systems are the most common type of fire sprinkler system. They are always full of water, even when there is no fire.</li><li data-sourcepos=\"8:1-9:0\" style=\"margin-bottom: 10px;\">Dry sprinkler systems are only filled with water when the sprinkler heads are activated. This type of system is used in areas where freezing temperatures are a concern.</li></ul><p data-sourcepos=\"10:1-10:110\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Fire sprinkler systems are also classified according to the temperature at which the sprinkler heads activate.</p><ul data-sourcepos=\"12:1-15:0\" style=\"margin-top: 4px; margin-bottom: 4px; padding-inline-start: 36px; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\"><li data-sourcepos=\"12:1-12:74\" style=\"margin-bottom: 10px;\">Ordinary temperature sprinkler heads activate at 135 degrees Fahrenheit.</li><li data-sourcepos=\"13:1-13:78\" style=\"margin-bottom: 10px;\">Intermediate-temperature sprinkler heads activate at 175 degrees Fahrenheit.</li><li data-sourcepos=\"14:1-15:0\" style=\"margin-bottom: 10px;\">High-temperature sprinkler heads activate at 212 degrees Fahrenheit.</li></ul><p data-sourcepos=\"16:1-16:141\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Fire sprinkler systems are required in most buildings by law. The specific requirements vary from country to country and from state to state.</p><p data-sourcepos=\"18:1-18:236\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">If you are considering installing a fire sprinkler system in your building, it is important to consult with a qualified fire protection engineer. They will be able to help you determine the best type of system for your needs and budget.</p><p data-sourcepos=\"20:1-20:56\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">Here are some of the benefits of fire sprinkler systems:</p><ul data-sourcepos=\"22:1-27:0\" style=\"margin-top: 4px; margin-bottom: 4px; padding-inline-start: 36px; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\"><li data-sourcepos=\"22:1-22:67\" style=\"margin-bottom: 10px;\">They can extinguish a fire quickly and prevent it from spreading.</li><li data-sourcepos=\"23:1-23:35\" style=\"margin-bottom: 10px;\">They can save lives and property.</li><li data-sourcepos=\"24:1-24:34\" style=\"margin-bottom: 10px;\">They are reliable and effective.</li><li data-sourcepos=\"25:1-25:55\" style=\"margin-bottom: 10px;\">They can be installed in almost any type of building.</li><li data-sourcepos=\"26:1-27:0\" style=\"margin-bottom: 10px;\">They are relatively inexpensive to maintain.</li></ul><p data-sourcepos=\"28:1-28:110\" style=\"margin-top: 24px; margin-bottom: 24px; white-space-collapse: preserve; word-break: break-word; color: rgb(31, 31, 31); font-family: &quot;Google Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif;\">If you are looking for a way to protect your building from fire, a fire sprinkler system is a wise investment.</p>', '1-Sam Dev', 1, '2023-08-19 17:09:43', '2023-12-14 11:07:15'),
(16, 'Fire Suppression Systems', 'fire-suppression-systems', 'Fire Suppression Systems in bangladesh', 'fire-protection-systems', '18', 'fire-suppression-systems-lightning-protection-system-2023-08-19-23-32-25-378541.jpg', 'Fire suppression systems are designed to control or extinguish fires in various environments, such as buildings, industrial facilities, and vehicles. These systems are crucial for minimizing the risk of fire-related damages, injuries, and loss of life. There are different types of fire suppression systems, each tailored to specific scenarios and types of fires. Some common types of fire suppression systems include:', '<p>Fire suppression systems are designed to control or extinguish fires in various environments, such as buildings, industrial facilities, and vehicles. These systems are crucial for minimizing the risk of fire-related damages, injuries, and loss of life. There are different types of fire suppression systems, each tailored to specific scenarios and types of fires. Some common types of fire suppression systems include:</p><p><br></p><p>1. **Water-Based Systems:**</p><p>&nbsp; &nbsp;- **Wet Pipe Sprinkler Systems:** These are the most common fire suppression systems, commonly found in commercial and residential buildings. They consist of pipes filled with water and sprinkler heads that release water when heat activates them.</p><p>&nbsp; &nbsp;- **Dry Pipe Sprinkler Systems:** Suitable for environments where freezing temperatures are a concern, these systems use compressed air instead of water in the pipes. When a sprinkler head is activated by heat, the air is released, allowing water to flow and extinguish the fire.</p><p><br></p><p>2. **Gaseous Fire Suppression Systems:**</p><p>&nbsp; &nbsp;- **Halon Replacement Systems:** Halon was once a popular fire suppressant due to its efficiency, but it was phased out due to environmental concerns. Various replacement gases like FM-200, Novec 1230, and Inergen are used to suppress fires in areas like data centers, control rooms, and sensitive equipment spaces.</p><p>&nbsp; &nbsp;- **CO2 (Carbon Dioxide) Systems:** CO2 is commonly used to suppress fires in areas with valuable equipment and electronics. It displaces oxygen and reduces the oxygen concentration, effectively extinguishing the fire.</p><p><br></p><p>3. **Foam-Based Systems:**</p><p>&nbsp; &nbsp;- **Foam Systems:** These are commonly used in industrial settings where flammable liquids are present. Foam is applied to the fire, forming a barrier between the fire source and the air, thus preventing the fire from spreading.</p><p><br></p><p>4. **Powder-Based Systems:**</p><p>&nbsp; &nbsp;- **Dry Chemical Systems:** Powder-based fire suppression systems use various dry chemical agents to smother fires. These systems are versatile and can be used in a range of environments, including industrial, commercial, and vehicle settings.</p><p><br></p><p>5. **Water Mist Systems:**</p><p>&nbsp; &nbsp;- **Water Mist Systems:** These systems use fine water droplets to suppress fires. The mist can cool the fire and displace oxygen, effectively extinguishing it. Water mist systems are particularly useful in scenarios where water damage needs to be minimized.</p><p><br></p><p>6. **Specialized Systems:**</p><p>&nbsp; &nbsp;- **Kitchen Suppression Systems:** Designed for commercial kitchens, these systems use a combination of wet chemicals to suppress fires that commonly occur due to cooking oils and fats.</p><p>&nbsp; &nbsp;- **Vehicle Fire Suppression Systems:** Commonly used in buses, trucks, and heavy equipment, these systems use specialized agents to suppress fires in vehicle engine compartments.</p><p><br></p><p>Fire suppression systems play a critical role in fire safety by quickly detecting and responding to fires, preventing their spread, and protecting both lives and property. The choice of system depends on the specific needs and potential fire risks of a given environment. Regular maintenance and inspections are essential to ensure that these systems remain effective and operational when needed.</p>', '1-Sam Dev', 1, '2023-08-19 17:32:25', '2023-12-14 11:07:29');
