(23, 'Digital Hotel Lock Systems', 'digital-hotel-lock-systems', NULL, 'home-hotel-automation', '25', 'digital-hotel-lock-systems-home-hotel-automation-2023-08-20-00-02-37-940293.jpg', 'Digital Hotel Lock System is a new and improved way of being able to access a room or home without having to use a bulky key, this kind of lock is opened with Finger,  Password, PVC Smart Card, or RFID access card. Lock which is designed especially for Homes brings a new user experience to homeowners.', '<p style=\"margin-bottom: 26px; line-height: 1.8; color: rgb(69, 69, 69); font-family: poppins, sans-serif; font-size: 15px;\"><span style=\"color: rgb(122, 122, 122); font-family: Roboto, sans-serif; font-size: 16px;\">Digital Hotel Lock System is a new and improved way of being able to access a room or home without having to use a bulky key, this kind of lock is opened with Finger,&nbsp; Password, PVC Smart Card, or RFID access card.&nbsp;</span><a href=\"https://technoapogee.com/hotel-automation-systems/\" style=\"color: rgb(37, 37, 37); transition: all 0.3s ease 0s; cursor: pointer; background-color: rgb(255, 255, 255); box-shadow: none; font-family: Roboto, sans-serif; font-size: 16px; outline: none !important;\">Lock</a><span style=\"color: rgb(122, 122, 122); font-family: Roboto, sans-serif; font-size: 16px;\">&nbsp;which is designed especially for Homes brings a new user experience to homeowners.</span></p><h5 style=\"font-weight: 700; line-height: 32px; font-size: 22px; font-family: &quot;Fira Sans&quot;; color: rgb(28, 28, 37); overflow-wrap: break-word;\">Advantages of Digital Hotel Lock Systems:</h5><ul style=\"padding-left: 1.59rem; margin-bottom: 0px; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\"><li style=\"list-style: none; line-height: 2.2;\"><ul style=\"overflow-wrap: break-word;\"><li style=\"list-style: none; line-height: 2.2;\">Increased Security: All over the world requires a high-security<span style=\"font-weight: bolder;\"><a href=\"https://technoapogee.com/home-hotel-automation/\" style=\"color: rgb(37, 37, 37); transition: all 0.3s ease 0s; cursor: pointer; box-shadow: none; outline: none !important;\">&nbsp;lock solution.</a></span></li><li style=\"list-style: none; line-height: 2.2;\">Smart Carrying: Guests can easily store entry cards in their wallets or pocket without them being too bulky or uncomfortable.</li></ul></li></ul>', '1-Sam Bd', 1, '2023-08-19 18:02:37', '2023-08-19 18:02:37'),
(24, 'Lighting Management Systems', 'lighting-management-systems', NULL, 'home-hotel-automation', '25', 'lighting-management-systems-home-hotel-automation-2023-08-20-00-03-40-094155.jpg', 'Lighting Management System Solutions is an appropriate and dependable system where Lighting Control System is designed to the right lighting, Exactly where it‚Äôs needed, and meet requirements can be a cost-effective investment that saves energy, Improves the work environment. In daylight and motion/presence lighting control systems,', '<p style=\"margin-bottom: 26px; line-height: 1.8;\"><span style=\"color: rgb(122, 122, 122); font-family: Roboto, sans-serif;\">Lighting Management System Solutions is an appropriate and dependable system where Lighting Control System is designed to the right lighting, Exactly where it‚Äôs needed, and meet requirements can be a cost-effective investment that saves energy, Improves the work environment. In daylight and motion/presence lighting control systems, the available daylight in a room is supplemented as needed by artificial light from luminaires with dimmable electronic ballasts. Light sensors detect the lighting level comprising artificial light and natural daylight. The groups of luminaries are controlled according to their position in the room and the amount of available daylight so that a predefined lighting level is maintained that meets their specific needs. the motion sensor is also used, the lighting is automatically switched on only when someone enters an empty room or if someone is in the room.&nbsp;</span></p><h6 style=\"font-weight: 700; line-height: 30px; font-size: 18px; font-family: &quot;Fira Sans&quot;; color: rgb(28, 28, 37); overflow-wrap: break-word;\"><span style=\"font-weight: bolder;\">Advantage of Lighting Systems Solution:</span></h6><p style=\"margin-bottom: 26px; line-height: 1.8; overflow-wrap: break-word; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">&nbsp;&nbsp; ‚Ä¢ Optimizing natural light &amp; implementing dimmers &amp; occupancy sensors that will cut energy costs<br>&nbsp;&nbsp; ‚Ä¢ Save as much as 60% on operating &amp; maintenance costs &amp; increase the value of your building with Lighting Control.<br>&nbsp;&nbsp; ‚Ä¢ Achieve ultra-effective operation &amp; management as lighting control is easy to manage.</p><p style=\"margin-bottom: 26px; line-height: 1.8;\"><br style=\"color: rgb(69, 69, 69); font-family: poppins, sans-serif; font-size: 15px;\"></p>', '1-Sam Bd', 1, '2023-08-19 18:03:40', '2023-08-19 18:03:40'),
(25, 'Residential Digital Lock', 'residential-digital-lock', NULL, 'home-hotel-automation', '25', 'residential-digital-lock-home-hotel-automation-2023-08-20-00-05-38-327335.jpg', 'Digital Residential Lock Systems are the new and improved way of being able to access a room or home without having to use a bulky key, this kind of lock is opened with Finger,  Password, PVC smart Card, or RFID access card. Lock which is designed especially for Homes brings a new user experience to homeowners.', '<p><span style=\"color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">Digital Residential Lock Systems are the new and improved way of being able to access a room or home without having to use a bulky key, this kind of lock is opened with Finger,&nbsp; Password, PVC smart Card, or RFID access card.&nbsp;</span><a href=\"https://technoapogee.com/hotel-automation-systems/\" style=\"color: rgb(37, 37, 37); transition: all 0.3s ease 0s; cursor: pointer; background-color: rgb(255, 255, 255); box-shadow: none; font-family: Roboto, sans-serif; outline: none !important;\">Lock</a><span style=\"color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">&nbsp;which is designed especially for Homes brings a new user experience to homeowners.</span><br></p>', '1-Sam Bd', 1, '2023-08-19 18:05:38', '2023-08-19 18:05:38'),
(1002, 'Hotel & Hospital Solutions', 'hotel-hospital-solutions', 'Hotel & Hospital Solutions in bangladesh', 'bms', '33', 'hotel-hospital-solutions-bms-2023-10-01-11-09-15-801482.jpg', 'Detection of the presence of border without cardholder, Lighting Control, Heating-Cooling Control, Shutter-Blind Control, Shutter-Blind Control, Nursing Call System Integration, BMS Integration', '<p>We provide a Guest Room Management System (GRMS) for star rating Hotels&nbsp;from EAE \r\nTechnology, Turkey. It is designed to ensure a mind-blowing experience for your guests. Our \r\nintelligent solutions are based on interactive technology that compliments the exceptional \r\nexperience you want for your guests in all areas, such as restaurants, ballrooms, meeting \r\nrooms, and gym &amp; fitness clubs.\r\nImplementing an Automation System in a hospital helps improve overall hospital management, \r\nenhance staff‚Äôs working efficiency, save operating costs, and create a safe and efficient \r\nhealthcare environment</p><p><br></p><ol><li>Detection of the presence of \r\nborder without cardholder</li><li>Lighting Control</li><li>Heating-Cooling Control</li><li>Shutter-Blind Control</li><li>Shutter-Blind Control</li><li>Nursing Call System \r\nIntegration</li><li>BMS Integration&nbsp;<br></li><li>&nbsp;<br></li></ol>', '1-Sam Dev', 1, '2023-10-01 05:09:15', '2023-12-14 10:59:46'),
(1003, 'Office and Shopping Malls Automation Solution', 'office-and-shopping-malls-automation-solution', 'Office and Shopping Malls Automation Solution in bangladesh', 'bms', '33', 'office-and-shopping-malls-automation-solution-bms-2023-10-01-11-13-23-353039.jpg', 'Lighting Control, Heating-Cooling Control, Shutter-Blind Control, Presence/Movement Detection, Daylight Detection, BMS Integration', '<p>From Bangladesh\'s perspective, Energy Saving is very important due to the scarcity of fuel, and \r\nan office\'s security is also crucial. Our Automation Solution aims to improve the quality of your \r\noffice experience by increasing security and comfort while at the same time-saving energy.\r\nIn this case, our Automation solution is not only applied in shopping malls but also in individual \r\nshops. We can also provide a similar type of solution for Chain Stores</p><ol><li>Lighting Control</li><li>Heating-Cooling Control</li><li>Shutter-Blind Control</li><li>Presence/Movement \r\nDetection</li><li>Daylight Detection</li><li>BMS Integration<br></li></ol>', '1-Sam Dev', 1, '2023-10-01 05:13:23', '2023-12-14 10:59:57'),
(1004, 'Automation Solution for Residences and Villas', 'automation-solution-for-residences-and-villas', 'Automation Solution for Residences and Villas in bangladesh', 'bms', '33', 'automation-solution-for-residences-and-villas-bms-2023-10-01-11-17-34-846662.jpg', 'Lighting Control, Security and Cameras, Concierge Services, Heating-Cooling Control, Display of Scenarios, Schedules, Mobile Phone Integration, Shutter-Blind Control, Video Intercom, TV Control, BMS Integration, Site Management, Sound Control', '<p>Our Smart Home Solutions will simplify your life with reliable, intelligent, and user-friendly devices. With one device, \r\nanyone in your family can operate the lights, blinds, thermostats, intercom, security, concierge, and more</p><ol><li>Lighting Control</li><li>Security and Cameras</li><li>Concierge Services</li><li>Heating-Cooling Control</li><li>Display of Scenarios, \r\nSchedules</li><li>Mobile Phone Integration</li><li>Shutter-Blind Control</li><li>Video Intercom</li><li>TV Control</li><li>BMS Integration</li><li>Site Management</li><li>Sound Control<br></li></ol>', '1-Sam Dev', 1, '2023-10-01 05:17:35', '2023-12-14 11:00:08'),
(1005, 'Industrial and Warehouse Automation Solution', 'industrial-and-warehouse-automation-solution', 'Industrial and Warehouse Automation Solution in bangladesh', 'bms', '33', 'industrial-and-warehouse-automation-solution-bms-2023-10-01-11-32-22-458224.jpg', 'Lighting Control, Heating-Cooling Control, Shutter-Blind Control, Presence/Movement Detection, Daylight Detection, BMS Integration', '<p>Our industrial building solutions are flexible and scalable to fulfill all the requirements and \r\nexpectations of customers. The products and devices from EAE are designed with \r\nmanufacturer-independent protocols such as KNX, making system extensions possible with any \r\nother KNX-manufactured products.\r\nAn energy-efficient lighting and climate control system is installed using dimmable lighting fixtures \r\nwith motion sensors specially designed for warehouses, which are generally 24/7 working \r\nfacilities</p><ol><li>Lighting Control</li><li>Heating-Cooling Control</li><li>Shutter-Blind Control</li><li>Presence/Movement \r\nDetection</li><li>Daylight Detection</li><li>BMS Integration<br></li></ol>', '1-Sam Dev', 1, '2023-10-01 05:32:22', '2023-12-14 11:00:33'),
(1006, 'Networking Systems', 'networking-systems', 'Networking System In Bangladesh', 'security-automation', '36', 'networking-systems-security-automation-2023-10-03-14-52-56-510364.jpg', 'Networking Systems are Hardware and Software that Comprise Computer Data Communications Networks. They Install, Configure, and Maintain Network Components and work on Client Workstations, Servers, Domain Controllers, Shared Printers, Cables, and Routers. They maintain Network Equipment, Applications, Data, and User Interfaces Workstations and troubleshoot local and wide area networks', '<p>Networking Systems are Hardware and Software that \r\nComprise Computer Data Communications Networks. They \r\nInstall, Configure, and Maintain Network Components and work on Client Workstations, Servers, Domain Controllers, Shared \r\nPrinters, Cables, and Routers. They maintain Network \r\nEquipment, Applications, Data, and User Interfaces Workstations \r\nand troubleshoot local and wide area networks</p><p>Benefits of Networking System</p><ol><li>Sharing data between users &amp; peripheral devices \r\nlike printers, scanners, or software</li><li>Cost-efficient and can help protect your systems if \r\nyou properly secure the network.</li><li>Access files and multimedia, images, and music, \r\nwhich are stored remotely on NAS devices.</li><li><br></li></ol>', '1-Sam Dev', 1, '2023-10-03 08:52:56', '2023-12-13 06:23:55'),
(1007, 'Closed Circuit Television (CCTV) Systems', 'closed-circuit-television-cctv-systems', 'Closed Circuit Television (CCTV) Systems in bangladesh', 'security-automation', '36', 'closed-circuit-television-cctv-systems-security-automation-2023-10-03-14-55-21-720335.jpg', 'Security Cameras, Systems, and Technology have evolved considerably for Analog CCTV and Network IP Surveillance Systems. CCTV relies on the strategic placement of Cameras and observation of the Camera\'s input on monitors somewhere. Because the cameras communicate with monitors and/or Video Recorders across private Coaxial/Network cable runs or Wireless Communication.', '<p>Security Cameras, Systems, and Technology have evolved considerably \r\nfor Analog CCTV and Network IP Surveillance Systems. CCTV relies on \r\nthe strategic placement of Cameras and observation of the Camera\'s \r\ninput on monitors somewhere. Because the cameras communicate \r\nwith monitors and/or Video Recorders across private \r\nCoaxial/Network cable runs or Wireless Communication.</p><p>Benefits of CCTV Camera</p><ol><li>CCTV provides instant alerts when in trouble, ensuring crime \r\nagainst people, theft, and vandalism.</li><li>Organizations use CCTV to monitor the actions of workers.</li><li>CCTV is used in both internal &amp; external environments to watch over \r\nand protect people, property, vehicles, and valuables.<br></li></ol>', '1-Sam Dev', 1, '2023-10-03 08:55:21', '2023-12-14 10:57:10'),
(1008, 'PABX Systems', 'pabx-systems', 'PABX Systems in bangladesh', 'security-automation', '36', 'pabx-systems-security-automation-2023-10-03-14-57-22-311065.png', 'PABX stands for private branch exchange, a  private telephone network used within a company  or organization. The users of the PBX can  communicate internally (within their company) and  externally (with the outside world), using different  communication channels like voice over IP, ISDN, or  analog.', '<p>PABX stands for private branch exchange, a \r\nprivate telephone network used within a company \r\nor organization. The users of the PBX can \r\ncommunicate internally (within their company) and \r\nexternally (with the outside world), using different \r\ncommunication channels like voice over IP, ISDN, or \r\nanalog.</p><p>Benefits of PABX Systems</p><ol><li>Internal Communications, Call Waiting, Conference \r\nCalling, Flexible Call Routing.</li><li>Centralized Control, Internet integration.</li><li>Voice Recording, Cost Monitoring.<br></li></ol>', '1-Sam Dev', 1, '2023-10-03 08:57:22', '2023-12-14 10:57:35'),
(1009, 'Public Address Systems', 'public-address-systems', 'Public Address Systems in bangladesh', 'security-automation', '36', 'public-address-systems-security-automation-2023-10-03-14-59-33-107357.jpg', 'A Public Address System (PA system) is a Sound Amplification System that allows a person or persons to address an audience at a greater volume than possible.  Public Address System contains Microphones, mixers, Amplifiers, and Loudspeakers used to amplify speech or music in a large building, to broadcast a speech in a public place or meeting, or at an outdoor gathering.  Conference Systems Transmits Speech Reliably and During Discussion/Debates, Multi-lingual meetings, company conferences, or conference calls ‚Äì everyone wants to be heard and clearly understood.', '<p>A Public Address System (PA system) is a Sound Amplification System \r\nthat allows a person or persons to address an audience at a greater \r\nvolume than possible.\r\n</p><p>Public Address System contains Microphones, mixers, Amplifiers, and \r\nLoudspeakers used to amplify speech or music in a large building, \r\nto broadcast a speech in a public place or meeting, or at an \r\noutdoor gathering.\r\n</p><p>Conference Systems Transmits Speech Reliably and During \r\nDiscussion/Debates, Multi-lingual meetings, company \r\nconferences, or conference calls ‚Äì everyone wants to be \r\nheard and clearly understood.&nbsp;</p><p>Benefits of PA (Public Address Systems)</p><ol><li>PA Systems continue a vital role in Communication to\r\n convey a message.</li><li>PA Systems help address Large Crowds of People.</li><li>PA System helps your Voice to become much Louder\r\n than you could be.<br></li></ol>', '1-Sam Dev', 1, '2023-10-03 08:59:33', '2023-12-14 10:57:53'),
(1010, 'Video Conference Systems', 'video-conference-systems', 'Video Conference Systems in bangladesh', 'security-automation', '36', 'video-conference-systems-security-automation-2023-10-03-15-15-38-961305.jpg', 'A Video Conference (a video teleconference) between two or more people is distributed geographically through the Internet to transmit audio and video data for real-time communication and collaboration. Video Conferencing includes Point-to-point and Multipoint Videoconferencing Systems.', '<p>A Video Conference (a video teleconference) between \r\ntwo or more people is distributed geographically through \r\nthe Internet to transmit audio and video data for real-time \r\ncommunication and collaboration. Video Conferencing \r\nincludes Point-to-point and Multipoint Videoconferencing \r\nSystems.</p><p>Benefits of Video Conference Systems</p><ol><li>Saves Travel Costs.</li><li>It prevents the Participants from having to spend time \r\nTravelling to meet each other.</li><li>The Participants in different locations can work on \r\nthe same Electronic Document.<br></li></ol>', '1-Sam Dev', 1, '2023-10-03 09:15:39', '2023-12-14 10:58:08'),
(1011, 'Intruder / Burglar Alarm System', 'intruder-burglar-alarm-system', 'Intruder / Burglar Alarm System in bangladesh', 'security-automation', '36', 'intruder-burglar-alarm-system-security-automation-2023-10-03-15-20-05-986073.jpeg', 'Multiple notification options based on customer preferences and decision-making policies with Text & voice SMS. Immediate access to critical information, burglary monitoring, business open or close supervision. Hold up, panic alarm, tamper & power monitoring.', '<p>An Intruder/Burglar Alarm System detects unauthorized \r\nentry to properties like Residential, Commercial, and industrial buildings for protection against burglary (theft) or \r\nproperty damage. </p><p>\r\nBurglar Alarm Systems connect to your Smartphone, \r\ntablet, or family members. Occupants will be alerted \r\nwhen their alarm is triggered. These systems also \r\nallow you to control your smart security from your \r\nphone, even when you\'re away from home.</p><p>Benefits of Burglar /Intruder Alarm</p><ol><li>Multiple notification options based on customer preferences and \r\ndecision-making policies with Text &amp; voice SMS.</li><li>Immediate access to critical information, burglary monitoring, business open \r\nor close supervision.</li><li>Hold up, panic alarm, tamper &amp; power monitoring.&nbsp;<br></li></ol>', '1-Sam Dev', 1, '2023-10-03 09:20:06', '2023-12-14 10:58:36'),
(1012, 'Baggage Scanner & Metal Detector', 'baggage-scanner-metal-detector', 'Baggage Scanner & Metal Detector in bangladesh', 'security-automation', '36', 'baggage-scanner-metal-detector-security-automation-2023-10-03-15-23-39-930981.jpeg', 'A Baggage Scanner consists of a conveyor and screen that can detect a range of sophisticated threats in passengers\' baggage. X-ray baggage scanners are ideal for checkpoints, Small Baggage, and large baggage scanning in high-security premises such as Airports, Government offices, Railways, Commercial buildings, hotels, and other premises applications.  A Metal Detector is an electronic instrument that detects metal nearby. Metal detectors are useful for finding metal inclusions hidden within objects or metal objects buried underground. They often consist of a handheld unit with a sensor probe that can be swept over the ground or other objects.', '<p>A Baggage Scanner consists of a conveyor and \r\nscreen that can detect a range of sophisticated \r\nthreats in passengers\' baggage. X-ray baggage \r\nscanners are ideal for checkpoints, Small Baggage, \r\nand large baggage scanning in high-security \r\npremises such as Airports, Government offices, \r\nRailways, Commercial buildings, hotels, and other \r\npremises applications.\r\n</p><p>A Metal Detector is an electronic instrument that detects \r\nmetal nearby. Metal detectors are useful for finding metal \r\ninclusions hidden within objects or metal objects buried \r\nunderground. They often consist of a handheld unit with a \r\nsensor probe that can be swept over the ground or other \r\nobjects.</p><p>Benefits of Baggage Scanner</p><ol><li>Most efficient devices in public places to scan through thousands of \r\nitems and cargo that pass through the conveyor belt daily.</li><li>Previously detected knife tools, narcotics, and weapons.</li></ol><p>Benefits of Metal Detector</p><ol><li>The walk-through Detector alerts security personnel when a \r\nperson passing through the arch carries metallic objects.</li><li>A handheld Detector is primarily used by security personnel to \r\nphysically examine if the person is concealing a metallic object.<br></li></ol>', '1-Sam Dev', 1, '2023-10-03 09:23:40', '2023-12-14 10:58:52'),
(1013, 'Parking Management Systems', 'parking-management-systems', 'Parking Management Systems in bangladesh', 'security-automation', '36', 'parking-management-systems-security-automation-2023-10-03-15-32-26-785334.jpg', 'Parking is how a property first welcomes its visitors, placing a first belief for the remainder of the visit. Generally, we need help parking our vehicles, like where to park, who will take care of our vehicles, and what if someone stoles the vehicle. The Parking System helps everyone make the parking area safer for its visitors. It is one of the most important transportation and hospitality system components.  Parking Management System also carries car parking counting display, parking solutions which can be manual or automatic pay stations & ticket validating machines. The Apogee Automation Ltd offers are assured with increased accuracy & affordable technology.', '<p>Parking is how a property first welcomes its visitors, \r\nplacing a first belief for the remainder of the visit. \r\nGenerally, we need help parking our vehicles, like \r\nwhere to park, who will take care of our vehicles, and \r\nwhat if someone stoles the vehicle. The Parking \r\nSystem helps everyone make the parking area \r\nsafer for its visitors. It is one of the most important \r\ntransportation and hospitality system \r\ncomponents.\r\n</p><p>Parking Management System also carries car \r\nparking counting display, parking solutions \r\nwhich can be manual or automatic pay \r\nstations &amp; ticket validating machines. The \r\nApogee Automation Ltd offers are \r\nassured with increased accuracy &amp; \r\naffordable technology.</p><p>Benefits of Car Parking Systems</p><ol><li>An Optimal Parking Solution helps users find the best spot available, saving time \r\n&amp; traffic flow increases.</li><li>Optimal Parking Solution decreases driving time, lowering vehicle emissions and \r\nreducing global environmental footprint.</li><li>Integrated payments and POS: Save time, and reduce manipulation &amp; errors by \r\nreducing time on redundant data entry.<br></li></ol>', '1-Sam Dev', 1, '2023-10-03 09:32:26', '2023-12-14 10:59:10'),
(1014, 'Software Based Hotel & Residential Lock & Iron Safe', 'software-based-hotel-residential-lock-iron-safe', 'Software Based Hotel & Residential Lock & Iron Safe in bangladesh', 'security-automation', '36', 'software-based-hotel-residential-lock-iron-safe-security-automation-2023-10-03-15-39-55-240710.png', 'Electronic Hotel Lock Systems is a new and improved way of accessing a room or home without having to use a bulky key; this kind of lock is opened with a PVC smart Card or RFID access card, simple and light, just like a credit card. Electronic Lock is designed especially for hotels & resorts and brings new user experiences to guests and hotel owners. Guests could now just hold a card when out of the room, making it easier than carrying a key. No matter how many rooms he needs to enter, all will be just a card.', '<p>Electronic Hotel Lock Systems is a new and improved way of accessing a room or \r\nhome without having to use a bulky key; this kind of lock is opened with a PVC \r\nsmart Card or RFID access card, simple and light, just like a credit card. Electronic \r\nLock is designed especially for hotels &amp; resorts and brings new user experiences \r\nto guests and hotel owners. Guests could now just hold a card when out of the \r\nroom, making it easier than carrying a key. No matter how many rooms he needs \r\nto enter, all will be just a card.\r\n</p><p>Hotel owners can get an automated advantage by integrating Lock with PMS \r\n(Property Management Systems), Performing Tasks like; Front desk and \r\nhousekeeping, and Reservations. Customer relationship management, \r\nMaintenance management, Point of sale (POS), room management, and reporting.</p><p>Benefits of Digital\r\nHotel Lock Systems</p><ol><li>Increased Security: All over the world require a \r\nhigh-security lock solution.</li><li>Smart Carrying: Guests can easily store entry \r\ncards in their wallets or pockets without being too \r\nbulky or uncomfortable.</li><li>Software Suite. Hundreds of integrations reduce \r\noverhead costs &amp; develop business every day.<br></li><li><br></li></ol>', '1-Sam Dev', 1, '2023-10-03 09:39:55', '2023-12-14 10:59:22');
