(4, 'BRISTOL', 'bristol-2023-09-13-10-54-07-588554.png', 'fire-hydrant-sprinkler', 'fire-hydrant-sprinkler', 'Bristol was one of the first firefighting companies in the Middle East to receive an ISO 9001 certification, placing great emphasis on achieving local and international approvals on product certifications such as Kite Mark, LPCB, UL listing, and FM approval. Moreover, Bristol is certified to ISO 14001:2015 and ISO 45001:2018.\r\n\r\nWe focus on innovation by means of continual research and development of advanced firefighting solutions, ensuring we not only meet, but exceed the demands of our rapidly changing market.\r\n\r\nFor decades, we have been proudly supplying various government entities and sectors such as the oil and gas, commercial, and industrial sectors across the globe with world-class equipment and services.\r\n\r\nBristol has been serving Middle Eastern, African, Asian, and European markets for more than four decades with a vision to expand further.', 'Techno Apogee', 0, '2023-09-13 04:54:07', '2023-09-18 08:21:10'),
(5, 'LIFECO', 'lifeco-2023-09-13-10-53-09-940832.jpg', 'fire-hydrant-sprinkler', 'fire-hydrant-sprinkler', 'LIFECO is a highly acclaimed UK brand in the fire protection industry. Our reputation is built on product development and product engineering services that ensure compliance with international standards and major inspection organizations', 'Techno Apogee', 0, '2023-09-13 04:53:09', '2023-09-18 08:21:02'),
(7, 'SIMPLEX', 'simplex-2023-09-13-12-33-34-668211.png', 'fire-detection-alarm-systems', 'fire-detection-alarm-systems', 'In the world of fire protection, Simplex is synonymous with innovation and value. Discover why leading organizations around the globe rely on Simplex life safety systems to protect their people and property.', 'Techno Apogee', 0, '2023-09-13 06:33:34', '2023-09-18 08:21:51'),
(8, 'SIEMENS', 'siemens-2023-09-13-12-42-21-353772.png', 'fire-detection-alarm-systems', 'fire-detection-alarm-systems', 'Siemens is a technology company focused on industry, infrastructure, transport, and healthcare. From more resource-efficient factories, resilient supply chains, and smarter buildings and grids, to cleaner and more comfortable transportation as well as advanced healthcare, the company creates technology with purpose adding real value for customers.', 'Techno Apogee', 0, '2023-09-13 06:42:21', '2023-09-18 08:22:03'),
(9, 'COOPER', 'cooper-2023-09-13-12-46-44-504082.jpg', 'fire-detection-alarm-systems', 'fire-detection-alarm-systems', 'Since 1966, Cooper Power Systems (a division of Cooper Electric Supply Co.) has provided the tri-state area with emergency back-up and temporary electrical power to millions of customers. Honored as one of the nation‚Äôs premier distributors of Industrial and residential KOHLER Generators, Cooper has built a reputation for meticulous care and on-the-spot service in critical conditions. We have the technical assistance to supply the customer‚Äôs facility or business with the appropriate back up or emergency power with our highly trained technicians. Our expert Rental department has a fleet of mobile generator sets, 20kW up to 2,000kW ready to roll your job site or event 24 hours a day.', 'Techno Apogee', 0, '2023-09-13 06:46:44', '2023-09-18 08:22:28'),
(10, 'AKRONEX', 'akronex-2023-09-13-12-55-13-397131.png', 'fire-suppression-systems', 'fire-suppression-systems', 'AKRONEX International was established in 2007 and operates in the fire sector, which has become a must in technology age. Our company, which specializes in ‚ÄúAutomatic Fire Extinguishing Systems‚Äù, attaches great importance to the research and development which is the necessity of information age, and follows the technological developments in the world closely and adopts the principle of producing service with the latest products with international qualifications and approvals. AKRONEX International, which produces to many regions of the world, continues to expand its communication and production network with 16 representatives in different countries.', 'Sam', 0, '2023-09-13 06:55:13', '2023-10-12 04:30:36'),
(11, 'Specified Technologies Inc', 'specified-technologies-inc-2023-09-13-02-19-15-388166.png', 'expansion-joint-systems', 'expansion-joint-systems', 'Specified Technologies Inc. (STI) is an industry leader in developing innovative fire protection systems that help stop the spread of fire, smoke, and toxic fumes. For over 30 years, their management team has worked hand in hand with the construction industry to create simple solutions to complex firestopping problems.', 'Techno Apogee', 0, '2023-09-13 08:19:15', '2023-09-18 08:23:14'),
(12, 'Carrier Global Corporation', 'carrier-global-corporation-2023-09-13-02-22-35-270990.png', 'heating-ventilation-and-air-conditioning-hvac', 'heating-ventilation-and-air-conditioning-hvac', 'Carrier Global Corporation is an American multinational heating, ventilation, air conditioning, refrigeration, and fire and security equipment corporation based in Palm Beach Gardens, Florida.', 'Techno Apogee', 0, '2023-09-13 08:22:35', '2023-09-18 08:24:24'),
(13, 'Toshiba Air Conditioning', 'toshiba-air-conditioning-2023-09-13-02-30-25-721686.png', 'heating-ventilation-and-air-conditioning-hvac', 'heating-ventilation-and-air-conditioning-hvac', 'Toshiba Corporation is a Japanese multinational electronics company headquartered in Minato, Tokyo, Japan. Its diversified products and services include power, industrial and social infrastructure systems, elevators and escalators, electronic components, semiconductors, hard disk drives (HDD), printers, batteries, lighting, as well as IT solutions such as quantum cryptography which has been in development at Cambridge Research Laboratory, Toshiba Europe, located in the United Kingdom, now being commercialized. It was one of the biggest manufacturers of personal computers, consumer electronics, home appliances, and medical equipment. As a semiconductor company and the inventor of flash memory, Toshiba had been one of the top 10 in the chip industry until its flash memory unit was spun off as Toshiba Memory, later Kioxia, in the late 2010s.', 'Techno Apogee', 0, '2023-09-13 08:30:25', '2023-09-18 08:24:37'),
(14, 'DAIKIN', 'daikin-2023-09-13-02-34-47-181353.png', 'heating-ventilation-and-air-conditioning-hvac', 'heating-ventilation-and-air-conditioning-hvac', 'Creating air around the world for greater happiness and greater comfort‚Äî\r\nTo realize a sustainable society, Daikin will pursue new values in the environment and air.\r\nFor Perfecting the Air, Daikin will pursue solutions in the realm of air to contribute to the well-being of the ‚Äúearth‚Äù ‚Äúcities‚Äù and ‚Äúpeople.‚Äù', 'Techno Apogee', 0, '2023-09-13 08:34:47', '2023-09-18 08:24:49'),
(15, 'DTM', 'dtm-2023-09-13-02-40-26-918049.jpg', 'busbar-trunking-systems-bbt', 'busbar-trunking-systems-bbt', 'DTM Elektroteknik San. and Tic. A.≈û. was established in 1977 to produce panels and thermal relays. In 2000, it offered the production of busbars from 25A to 6300A to its dealers and customers by its experienced and experienced managers.\r\nOur busbar systems are produced with aluminum and copper busbars on sheet metal and aluminum bodies, in accordance with international test and conformity documents.\r\n\r\nWe produce using the latest technologies in a 10000 m¬≤ factory area in Alemdaƒü-√áekmek√∂y.', 'Techno Apogee', 0, '2023-09-13 08:40:26', '2023-09-18 08:25:27'),
(17, 'NAFFCO', 'naffco-2023-09-13-04-06-22-564558.png', 'lightning-protection-systems-lps', 'lightning-protection-systems-lps', 'NAFFCO is a Middle East-based manufacturer of firefighting products, its business is built around fire protection engineering. It has headquarters in Dubai, United Arab Emirates, in the Jebel Ali Free Zone, and it conducts all manufacturing in the UAE.', 'Sam', 0, '2023-09-13 10:06:22', '2023-10-12 04:35:15'),
(18, 'EAE', 'eae-2023-09-13-04-59-48-642663.jpg', 'automation-solutions', 'automation-solutions', 'EAE Group companies, established with 100% domestic capital, 5 factories in Turkey (2 in Istanbul, 3 in Kocaeli) and 1 factory in Russia, exports to more than 100 countries, companies in Russia, Italy, America and Germany, They are among the leading companies in the Turkish Electrical Products Market with branches-representatives in many countries.', 'Techno Apogee', 0, '2023-09-13 10:59:48', '2023-09-18 04:02:10'),
(19, 'KNX', 'knx-2023-09-13-05-44-19-792523.png', 'automation-solutions', 'automation-solutions', 'KNX is an open standard for commercial and residential building automation. KNX devices can manage lighting, blinds and shutters, HVAC, security systems, energy management, audio video, white goods, displays, remote control, etc.', 'Techno Apogee', 0, '2023-09-13 11:44:19', '2023-09-18 04:02:42'),
(20, 'DALI', 'dali-2023-09-13-05-46-02-145900.png', 'automation-solutions', 'automation-solutions', 'DALI-2. DALI stands for ‚ÄúDigital Addressable Lighting Interface‚Äù. The information below provides an introduction to DALI, some information on the DALI protocol', 'Techno Apogee', 0, '2023-09-13 11:46:02', '2023-09-18 08:19:16'),
(21, 'DELL', 'dell-2023-09-14-10-36-53-560700.png', 'networking-systems', 'networking-systems', 'Dell Inc. is an American based technology company. It develops, sells, repairs, and supports computers and related products and services. Dell is owned by its parent company, Dell Technologies', 'Techno Apogee', 0, '2023-09-14 04:36:53', '2023-09-18 08:27:07'),
(22, 'CISCO', 'cisco-2023-09-14-10-40-02-619038.png', 'networking-systems', 'networking-systems', 'Cisco Systems, Inc., commonly known as Cisco, is an American-based multinational digital communications technology conglomerate corporation headquartered in San Jose, California.', 'Techno Apogee', 0, '2023-09-14 04:40:02', '2023-09-18 08:27:17'),
(23, 'Ubiquiti Network', 'ubiquiti-network-2023-09-14-10-46-36-827618.png', 'networking-systems', 'networking-systems', 'Ubiquiti Inc. is an American technology company founded in San Jose, California, in 2003. Now based in New York City, Ubiquiti manufactures and sells wireless data communication and wired products for enterprises and homes under multiple brand names', 'Techno Apogee', 0, '2023-09-14 04:46:37', '2023-09-18 08:27:33'),
(24, 'Cambium Networks', 'cambium-networks-2023-09-14-10-48-53-322113.png', 'networking-systems', 'networking-systems', 'Cambium Networks is a wireless infrastructure provider that offers fixed wireless and Wi-Fi to broadband service providers and enterprises to provide Internet access.', 'Techno Apogee', 0, '2023-09-14 04:48:53', '2023-09-18 08:27:47'),
(25, 'PLANET Technology Corporation', 'planet-technology-corporation-2023-09-14-10-55-29-477527.jpg', 'networking-systems', 'networking-systems', 'PLANET Technology Corporation is a leading global provider of IP-based networking products and solutions for small-to-medium-sized businesses, enterprises, and network infrastructures of IoT, IIoT and IoV applications.', 'Techno Apogee', 0, '2023-09-14 04:55:29', '2023-09-18 08:28:00'),
(26, 'HikVision', 'hikvision-2023-09-14-10-58-16-191518.jpg', 'cctv-systems', 'cctv-systems', 'Hangzhou Hikvision Digital Technology Co., Ltd., often shortened to Hikvision, is a Chinese state-owned manufacturer and supplier of video surveillance equipment for civilian and military purposes, headquartered in Hangzhou, Zhejiang', 'Techno Apogee', 0, '2023-09-14 04:58:16', '2023-09-18 08:28:47'),
(27, 'Dahua Technology', 'dahua-technology-2023-09-14-10-59-57-831723.jpg', 'cctv-systems', 'cctv-systems', 'Zhejiang Dahua Technology Co., Ltd. is a partly state-owned publicly traded company based in Binjiang District, Hangzhou, which manufactures video surveillance equipment. It was founded in 2001 by Fu Liquan. Dahua Technology has been listed on the Shenzhen Stock Exchange since its IPO in 2008.', 'Techno Apogee', 0, '2023-09-14 04:59:57', '2023-09-18 08:29:25'),
(28, 'Panasonic', 'panasonic-2023-09-14-11-02-14-624398.png', 'pabx-systems', 'pabx-systems', 'Panasonic Holdings Corporation is a Japanese multinational electronics company, headquartered in Kadoma, Osaka. It was founded in 1918 as Matsushita Electric Housewares Manufacturing Works in Fukushima, Osaka by K≈çnosuke Matsushita. In 1935, it was incorporated and renamed Matsushita Electric Industrial Co., Ltd.', 'Techno Apogee', 0, '2023-09-14 05:02:14', '2023-09-18 08:30:01'),
(29, 'Grandstream Networks', 'grandstream-networks-2023-09-14-11-04-40-672509.jpeg', 'pabx-systems', 'pabx-systems', 'Founded in 2002, Grandstream Networks is a manufacturer of IP voice and video communications equipment, video surveillance, gateways and analog telephone adapters, and Asterisk-based IP-PBX appliances. Grandstream supplies small and medium businesses and consumers with open-standard SIP-based products.', 'Techno Apogee', 0, '2023-09-14 05:04:40', '2023-09-18 08:30:20'),
(30, 'ITC', 'itc-2023-09-14-11-07-17-634821.jpg', 'public-address-systems', 'public-address-systems', 'Guangdong Baolun Electronic Co.,Ltd(ITC) was founded in 1993,with more than 6,000 staffs in total.We are professional manufacturer for audiovisual & lighting products.Our products are exported to all over the world with good reputation.ITC successful cases exceed 1,500,000.', 'Techno Apogee', 0, '2023-09-14 05:07:17', '2023-09-18 08:31:24'),
(31, 'BOSCH', 'bosch-2023-09-14-11-41-01-249154.jpg', 'public-address-systems', 'public-address-systems', 'Robert Bosch GmbH, commonly known as Bosch, is a German multinational engineering and technology company headquartered in Gerlingen, Germany. The company was founded by Robert Bosch in Stuttgart in 1886. Bosch is 94% owned by the Robert Bosch Stiftung, a charitable institution', 'Techno Apogee', 0, '2023-09-14 05:41:01', '2023-09-18 08:31:02'),
(32, 'AVerMedia', 'avermedia-2023-09-14-12-13-57-146951.png', 'video-conference-systems', 'video-conference-systems', 'AVerMedia empowers people to easily connect and boldly create through innovative audiovisual technology. Our solutions help people work productively.', 'Techno Apogee', 0, '2023-09-14 06:13:57', '2023-09-18 08:31:52'),
(33, 'Teletek Electronics', 'teletek-electronics-2023-09-14-12-22-56-805452.png', 'intruder-burglar-alarm-system', 'intruder-burglar-alarm-system', 'Teletek Electronics JSC is the largest Bulgarian manufacturer of a complete range of alarm and fire alarm equipment. The company was founded in 1991 and quickly established itself as a leader in the domestic and international markets.', 'Techno Apogee', 0, '2023-09-14 06:22:56', '2023-09-18 08:32:19'),
(34, 'LifeSOS', 'lifesos-2023-09-14-12-55-46-931537.png', 'intruder-burglar-alarm-system', 'intruder-burglar-alarm-system', 'LifeSOS - A smart and reliable security system you can rely on. Fire prevention. Let our wireless addressable fire alarm system', 'Techno Apogee', 0, '2023-09-14 06:55:47', '2023-09-18 08:32:33'),
(35, 'Eastimage', 'eastimage-2023-09-14-01-00-57-164701.jpg', 'baggage-scanner-metal-detector', 'baggage-scanner-metal-detector', 'Shanghai Eastimage Equipment Co., Ltd, located in Shanghai Pudong New District is a leading security screening manufacturer that provides superior security products, multiple solutions and great service that meets our customers‚Äô most demanding threat detection needs.', 'Techno Apogee', 0, '2023-09-14 07:00:57', '2023-09-18 08:33:11'),
(36, 'Parktron', 'parktron-2023-09-18-03-36-05-277635.png', 'Parking Management Systems', 'parking-management-systems', 'Since its inception in 2001, Parktron has focused on building a comprehensive and scalable Intelligent Parking Management System - IPMS2000 to address the ever-growing traffic flow and parking shortage in the world. By using cutting-edge technologies (e.g. IoT, Cloud, LPR, QR code, Mobile Payment...) along with our extended ICT integration experience, Parktron parking system has been successfully installed in airports, hospitals, shopping malls, hotels, building complexes, campus parking lots, public parking lots and franchised automated (unmanned) parking lots in Middle East, Africa, South East Asia and Latin America.', 'Techno Apogee', 0, '2023-09-18 09:36:05', '2023-09-18 09:36:05'),
(37, 'Be-Tech', 'be-tech-2023-09-18-03-41-49-275990.png', 'digital-hotel-lock-systems', 'digital-hotel-lock-systems', 'Be-Tech provides different smart solutions for hotels and resorts, rental condominiums, private apartments and hostels. The stable smart products contain hotel door lock,\r\nfingerprint lock, keypad lock, locker lock, smart safe., etc. The high quality smart products integrate the functions\r\ndiversified and convenient operation improve experience and comfortable', 'Techno Apogee', 0, '2023-09-18 09:41:49', '2023-09-18 10:04:01'),
(38, 'BRISTOL', 'bristol-2023-10-12-10-29-10-594828.png', 'Fire Suppression Systems', 'fire-suppression-systems', 'Bristol was one of the first firefighting companies in the Middle East to receive an ISO 9001 certification, placing great emphasis on achieving local and international approvals on product certifications such as Kite Mark, LPCB, UL listing, and FM approval. Moreover, Bristol is certified to ISO 14001:2015 and ISO 45001:2018. We focus on innovation by means of continual research and development of advanced firefighting solutions, ensuring we not only meet, but exceed the demands of our rapidly changing market. For decades, we have been proudly supplying various government entities and sectors such as the oil and gas, commercial, and industrial sectors across the globe with world-class equipment and services. Bristol has been serving Middle Eastern, African, Asian, and European markets for more than four decades with a vision to expand further.', 'Sam', 0, '2023-10-12 04:29:10', '2023-10-12 04:29:10'),
(39, 'EAE', 'eae-2023-10-12-12-10-53-583227.jpg', 'Hotel & Hospital Solutions', 'hotel-hospital-solutions', 'EAE Group companies, established with 100% domestic capital, 5 factories in Turkey (2 in Istanbul, 3 in Kocaeli) and 1 factory in Russia, exports to more than 100 countries, companies in Russia, Italy, America and Germany, They are among the leading companies in the Turkish Electrical Products Market with branches-representatives in many countries.', 'Sam', 0, '2023-10-12 06:10:53', '2023-10-12 06:10:53'),
